[693] = {name = "Criar Pedra da Alma (Menor)", additional_info = "85% de base mana\n3 seg de lançamento\nReagentes:\nEstilhaço de Alma\n[q]Cria uma Pedra da Alma Menor, que pode ser usada para armazenar a alma de um alvo. Se o alvo morrer enquanto a alma estiver armazenada, ele poderá ressuscitar com 400 pontos de vida e 700 pontos de mana.\n\n Itens conjurados desaparecem se você ficar desconectado por mais de 15 minutos."},
[694] = {name = "Golpe Zombeteiro", additional_info = "{10 de Raiva} {Alcance corpo a corpo}\n{Conjuração instantânea} {2 min de recarga}\nRequer Arma corpo a corpo\nRequer Postura de Batalha\n[q]Um ataque zombeteiro que causa 22 de dano Físico, gera uma quantidade moderada de ameaça e força o alvo a atacar você por 6 sec."},
