[698] = {name = "Ritual de Evocação", additional_info = "{300 de Mana} {Alcance de 30m}\n5 seg de lançamento\nReagentes:\nEstilhaço de Alma\n[q]Inicia um ritual que evoca o integrante selecionado do grupo. Requer o lançador e outros 2 integrantes do grupo para completar o ritual. Para participarem, todos os jogadores devem estar fora de combate, clicar no portal com o botão direito e ficar imóveis até que o ritual seja concluído."},
[699] = {name = "Drenar Vida", additional_info = "{85 de Mana} {Alcance de 20m}\nCanalizado (5 seg de lançamento)\n[q]Transfere 17 pontos de vida a cada segundo do alvo para o lançador. Dura 5 sec."},
[700] = {name = "Sono", additional_info = "{60 de Mana} {Alcance de 30m}\n1.5 seg de lançamento\n[q]Faz um inimigo adormecer por até 20 sec. Qualquer dano acordará o alvo. Apenas um alvo pode ficar adormecido por vez."},
