[703] = {name = "Garrote", additional_info = "{50 de Energia} {Alcance corpo a corpo}\nInstantâneo\nRequer Furtividade\n[q]Garroteia o inimigo, causando 144 de dano ao longo de 18 sec. O dano aumenta de acordo com o seu Poder de Ataque. É preciso estar furtivo e atrás do alvo. Concede 1 ponto de combo."},
[704] = {name = "Maldição da Temeridade", additional_info = "{35 de Mana} {Alcance de 30m}\nInstantâneo\n[q]Amaldiçoa o alvo com Temeridade, aumentando em 20 o Poder de Ataque Corpo a Corpo, mas reduzindo em 140 a Armadura por 2 min. Inimigos amaldiçoados não fogem e ignoram efeitos de Medo e Horror. Os inimigos só podem ter uma Maldição de cada Bruxo por vez."},
