[1490] = {name = "Maldição dos Elementos", additional_info = "{100 de Mana} {Alcance de 30m}\nInstantâneo\n[q]Amaldiçoa o alvo por 5 min, reduzindo em 45 as resistências ao Fogo e ao Gelo e aumentando em 6% o dano recebido de Fogo e de Gelo. Os inimigos só podem ter uma Maldição de cada Bruxo por vez."},
[1494] = {name = "Rastrear Feras", additional_info = "Instantâneo\n[q]Mostra a localização de todas as feras próximas no minimapa. Somente uma forma de rastreamento pode estar ativa por vez."},
[1495] = {name = "Mordida de Mangusto", additional_info = "{30 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {5 seg de recarga}\n[q]Contra-ataca o inimigo, causando 25 de dano. Só pode ser usado após esquivar-se de um ataque."},
[1499] = {name = "Armadilha Congelante", additional_info = "50 de Mana\n{Instantâneo} {15 seg de recarga}\n[q]Posiciona uma armadilha gélida que congela o primeiro inimigo que se aproximar, impedindo-o de realizar qualquer ação por 10 sec. Qualquer dano causado quebrará o gelo. A armadilha existirá por 1 min. Só pode ser usada fora de combate. Só pode haver uma armadilha ativa por vez."},
[1509] = {name = "GM Only OFF", additional_info = nil},
[1510] = {name = "Salva", additional_info = "{350 de Mana} {Alcance de 8m}\n{Canalizado (6 seg de lançamento} {) 1 min de recarga}\nRequer Arma de Longo Alcance\n[q]Atira continuamente uma salva de munição contra a área selecionada, causando 50 de dano Arcano a alvos inimigos em um raio de 8 m a cada segundo por 6 sec."},
[1513] = {name = "Assustar Fera", additional_info = "{35 de Mana} {Alcance de 10m}\n{1.5 seg de lançamento} {30 seg de recarga}\n[q]Assusta uma fera, fazendo-a correr aterrorizada por até 10 sec. Qualquer dano causado ao alvo pode interromper o efeito. Apenas uma fera pode ser assustada por vez."},
[1515] = {name = "Domar Fera", additional_info = "{60% de base mana} {Alcance de 30m}\nCanalizado (20 seg de lançamento)\n[q]Começa a domar uma fera para ser seu ajudante. Sua Armadura é reduzida em 100% enquanto tente domar a fera por 20 sec. Se você perder a atenção da fera por qualquer razão, o processo será interrompido. Depois de domada, ela ficará infeliz e desleal. Alimente-a imediatamente para deixá-la feliz."},
[1516] = {name = "Disparo Veloz", additional_info = "Alcance de 5m\n1 min de recarga\nRequer Arma de Longo Alcance\n[q]Dispara instantaneamente a sua arma, causando 5 de dano adicional."},
[1528] = {name = "Liberar Mestre", additional_info = "Alcance de 5m\nInstantâneo\n[q]Liberta seu mestre de quaisquer vínculos."},
