[11974] = {name = "Palavra de Poder: Escudo", additional_info = "{110 de Mana} {Alcance de 40m}\nInstantâneo\n[q]Protege um aliado com um escudo que dura até 30 sec e absorve até 137 de dano Físico ou mágico. Enquanto o escudo durar, o lançamento de feitiços não será interrompido por ataques Físicos."},
[11975] = {name = "Explosão Arcana", additional_info = "120 de Mana\n1.5 seg de lançamento\n[q]Emite uma onda de impacto mágica, causando dano Arcano aos inimigos próximos."},
