[11981] = {name = "Exaurir Mana", additional_info = "{95 de Mana} {Alcance de 30m}\n3 seg de lançamento\n[q]Atinge um inimigo com um raio antimana. O alvo recebe 0.5 de dano para cada ponto de mana consumido."},
