[12758] = {name = "[q2]Capacete-foguete Goblínico", additional_info = "12.5 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nCapacete de Operário Goblínico , Combustível de Foguete Goblínico (4), Barra de Mithril (4), Gatilho Instável\n[q2]Capacete-foguete Goblínico\nVincula-se quando equipado\nCabeça Tecido\n50 Armadura\n+15 Vigor\nDurabilidade 45 / 45\nRequerEngenharia\n(235)\n[q2]Uso: Investe contra um inimigo, desnorteando-o por 30 s. Você também cai e fica atordoado por um curto período. Qualquer dano causado ao alvo fará com que ele recobre a consciência. (20 Min Recarga)"},
[12759] = {name = "Raio Gnômico da Morte", additional_info = "12.5 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nTubo de Mithril (2), Gatilho Instável , Essência de Morte-viva , Linfa de Morte-viva (4), Cilindro Marchetado de Mithril\nVincula-se ao ser recolhido\nBerloque\n[q2]Uso: Este dispositivo se recarrega ao longo do tempo com a sua força vital, e então dispara um poderoso raio contra o seu oponente. (5 Min Recarga)\n[q]\"O uso deste equipamento pode resultar em morte ou ferimentos graves.\""},
