[12903] = {name = "[q2]Cinto Gnômico de Prevenção de Ferimentos", additional_info = "45 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nCinto Crepuscular , Barra de Mithril (4), Barra de Veraprata (2), Gatilho Instável , Água-marinha (2)\n[q2]Cinto Gnômico de Prevenção de Ferimentos\nVincula-se quando equipado\nCintura Couro\n66 Armadura\n+6 Vigor\nDurabilidade 30 / 30\nRequerEngenharia\n(215)\n[q2]Uso: Escudo de força que protege você dos próximos 500 de dano recebido ao longo dos próximos 10 min. AVISO: O campo de força pode sofrer sobrecarga quando atingido, tirando o usuário temporariamente desta dimensão. (Chance de ativar:5%) (1 Horas Recarga)"},
