[12905] = {name = "[q2]Botas-foguete Gnômicas", additional_info = "12.5 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nBotas de Magitrama Preta , Tubo de Mithril (2), Couro Pesado (4), Pó Explosivo Maciço (8), Giroscronatom (4)\n[q2]Botas-foguete Gnômicas\nVincula-se quando equipado\nPés Tecido\n41 Armadura\nDurabilidade 35 / 35\nRequerEngenharia\n(225)\n[q2]Uso: Estas botas aumentam significativamente a sua velocidade de corrida por 20 sec. AVISO: A fonte de energia e os giroestabilizadores nem sempre funcionam corretamente. (30 Min Recarga)"},
[12906] = {name = "Frango de Batalha Gnômico", additional_info = "25 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nCarcaça de Mithril , Barra de Veraprata (6), Barra de Mithril (6), Cilindro Marchetado de Mithril (2), Núcleo de Força de Ouro , Jade (2)\nVincula-se ao ser recolhido\nBerloque\nRequerEngenharia\n(230)\n[q2]Uso: Cria um Frango de Batalha que lutará por você por 1.50 min ou até ser destruído. (30 Min Recarga)"},
[12907] = {name = "[q2]Casquete Gnômico de Controle Mental", additional_info = "25 seg de lançamento\nFerramentas: Martelo de Ferreiro , Chave de Arco Voltaico\nReagentes:\nBarra de Mithril (10), Barra de Veraprata (4), Núcleo de Força de Ouro , Rubi-estrela (2), Magitrama (4)\n[q2]Casquete Gnômico de Controle Mental\nVincula-se quando equipado\nCabeça Tecido\n50 Armadura\n+14 Espírito\nDurabilidade 45 / 45\nRequerEngenharia\n(215)\n[q2]Uso: Entra em combate mental contra um alvo humanoide. Se tudo der certo, você controlará a mente do alvo por 20 sec. (30 Min Recarga)"},
