[14514] = {name = "Lampejo", additional_info = "75 de Mana\nInstantâneo\n[q]Teleporta o lançador 20 m à frente, a não ser que algo esteja no caminho. Também liberta o lançador de quaisquer amarras."},
[14515] = {name = "Dominar Mente", additional_info = "{30 de Mana} {Alcance de 20m}\n2 seg de lançamento\n[q]Assume o controle de um inimigo humanoide até o nível 25 por 15 sec."},
[14516] = {name = "Golpear", additional_info = "Alcance corpo a corpo\nPróximo Mão a Mão\nRequer Arma corpo a corpo\n[q]Golpeia um inimigo, causando dano corpo a corpo aumentado."},
[14517] = {name = "Golpe do Cruzado", additional_info = "{40 de Mana} {Alcance corpo a corpo}\nInstantâneo\nRequer Arma corpo a corpo\n[q]Causa 27 de dano a um inimigo e aumenta em 10 o dano Sagrado que ele recebe por cada Golpe do Cruzado. Acumula até 5 vezes. Dura 30 sec."},
[14518] = {name = "Golpe do Cruzado", additional_info = "{40 de Mana} {Alcance corpo a corpo}\nInstantâneo\nRequer Arma corpo a corpo\n[q]Causa 50 de dano a um inimigo e aumenta em 20 o dano Sagrado que ele recebe por cada Golpe do Cruzado. Acumula até 5 vezes. Dura 30 sec."},
[14520] = {name = "Agilidade Mental", additional_info = "[q]Reduz em 2% o custo de mana de seus feitiços de lançamento instantâneo."},
[14521] = {name = "Meditação", additional_info = "[q]Permite que 5% da regeneração de mana continue enquanto estiver lançando feitiços."},
[14522] = {name = "Determinação Inabalável", additional_info = "[q]Aumenta em mais 3% a sua chance de resistir a efeitos de Atordoamento, Medo e Silêncio."},
[14523] = {name = "Determinação Silenciosa", additional_info = "[q]Reduz em 4% a ameaça gerada pelos seus feitiços."},
[14524] = {name = "Especialização em Varinha", additional_info = "[q]Aumenta em 5% seu dano com Varinhas."},
[14525] = {name = "Especialização em Varinha", additional_info = "[q]Aumenta em 10% seu dano com Varinhas."},
[14526] = {name = "Especialização em Varinha", additional_info = "[q]Aumenta em 15% seu dano com Varinhas."},
[14527] = {name = "Especialização em Varinha", additional_info = "[q]Aumenta em 20% seu dano com Varinhas."},
[14528] = {name = "Especialização em Varinha", additional_info = "[q]Aumenta em 25% seu dano com Varinhas."},
[14530] = {name = "Velocidade", additional_info = "Instantâneo\n[q]Aumenta em 40% a velocidade de corrida por 10 sec."},
[14531] = {name = "Martírio", additional_info = "[q]Ao receber um acerto crítico de um ataque corpo a corpo ou de longo alcance, você tem 50% de chance de ganhar o efeito Lançamento Concentrado por 6 sec. Este efeito impede que o lançamento de seus feitiços seja retardado ao receber dano e aumenta em 10% a sua resistência a efeitos de Interrupção.\n(Chance de ativar:50%)"},
[14532] = {name = "Peçonha de Rastejante", additional_info = "2 seg de lançamento\n[q]Aumenta em 30% o dano Físico recebido por inimigos próximos por 5 min."},
[14533] = {name = "Disjunção", additional_info = "Instantâneo\n[q]Aumenta em 50% o dano Arcano, de Fogo e de Gelo recebido pelos inimigos próximos por 5 min."},
[14534] = {name = "Aguilhão Farpado", additional_info = "Instantâneo\n[q]Aumenta em 54% o intervalo entre os ataques dos inimigos próximos por 5 min."},
[14535] = {name = "Arrasto Infeccioso", additional_info = "Instantâneo\n[q]Reduz em 25% todos os atributos de inimigos próximos por 5 min."},
[14537] = {name = "Bolsa Seis Demônios", additional_info = "Alcance de 30m\nInstantâneo\n[q]Atinge os inimigos à sua frente com o poder do vento, do fogo... esse tipo de coisa!"},
[14538] = {name = "Choque de Aura", additional_info = "Instantâneo\n[q]Reduz em 35% a velocidade de lançamento de feitiços dos inimigos próximos por 5 min."},
[14539] = {name = "Enzima Pútrida", additional_info = "Instantâneo\n[q]Aumenta em 50% o dano de Natureza recebido por inimigos próximos e em 50% o dano de Sombra que eles recebem. Dura 5 min."},
