[17634] = {name = "Frasco de Petrificação", additional_info = "25 seg de lançamento\nFerramentas: Pedra Filosofal\nReagentes:\nÓleo de Petrescama (30), Sálvia-prata-da-montanha (10), Lótus Preto , Ampola de Cristal\n50\n[q2]Uso: Você se transforma em pedra, protegendo-se de todos os ataques físicos e feitiços por 1 min, mas ficando impossibilitado de atacar, andar e lançar feitiços. Você só pode ter o efeito de um frasco por vez. (3 Seg Recarga)"},
[17635] = {name = "Frasco dos Titãs", additional_info = "25 seg de lançamento\nReagentes:\nSangue-de-grom (30), Óleo de Petrescama (10), Lótus Preto , Ampola de Cristal\n50\n[q2]Uso: Aumenta em 1200 o máximo de pontos de vida do jogador por 2 hrs. Você só pode ter o efeito de um frasco por vez. Este efeito continua após a morte. (3 Seg Recarga)"},
[17636] = {name = "Frasco de Sabedoria Destilada", additional_info = "25 seg de lançamento\nReagentes:\nFolha-de-sonho (30), Chapéu-de-gelo (10), Lótus Preto , Ampola de Cristal\n50\n[q2]Uso: Aumenta em 2000 o máximo de pontos de mana do jogador por 2 hrs. Você só pode ter o efeito de um frasco por vez. Este efeito continua após a morte. (3 Seg Recarga)"},
[17637] = {name = "Frasco de Poder Supremo", additional_info = "25 seg de lançamento\nReagentes:\nFolha-de-sonho (30), Sálvia-prata-da-montanha (10), Lótus Preto , Ampola de Cristal\n50\n[q2]Uso: Aumenta em até 150 o dano causado por efeitos e feitiços mágicos por 2 hrs. Você só pode ter o efeito de um frasco por vez. Este efeito continua após a morte. (3 Seg Recarga)"},
[17638] = {name = "Frasco de Resistência Cromática", additional_info = "25 seg de lançamento\nReagentes:\nChapéu-de-gelo (30), Sálvia-prata-da-montanha (10), Lótus Preto , Ampola de Cristal\n50\n[q2]Uso: Aumenta em 25 a sua resistência a todas as escolas de magia por 2 hrs. Você só pode ter o efeito de um frasco por vez. Este efeito continua após a morte e acumula com outros itens e feitiços de resistência. (3 Seg Recarga)"},
