[20154] = {name = "Selo da Retidão", additional_info = "20 de Mana\nInstantâneo\n[q]O Paladino é agraciado por um espírito sagrado por 30 sec, fazendo com que cada ataque corpo a corpo cause de 3 a 9 de dano Sagrado adicional. Armas mais lentas causam mais dano com cada golpe. O Paladino só pode ter um Selo ativo por vez."},
