[20162] = {name = "Selo do Cruzado", additional_info = "40 de Mana\nInstantâneo\n[q]O Paladino é agraciado pelo espírito de um cruzado por 30 sec, aumentando em 60 o Poder de Ataque Corpo a Corpo. Também aumenta em 40% a velocidade de ataque, mas cada golpe causa menos dano. O Paladino só pode ter um Selo ativo por vez.\n\n Ao liberar a energia do Selo, o inimigo será julgado por 10 sec, aumentando em até 30 o dano Sagrado recebido. Seus ataques corpo a corpo renovam a duração desse feitiço. Os inimigos só podem ter um Julgamento de cada Paladino por vez."},
[20164] = {name = "Selo da Justiça", additional_info = "13% de base mana\nInstantâneo\n[q]O Paladino fica iluminado pelo espírito da justiça por 30 sec, fazendo com que cada ataque corpo a corpo tenha chance de atordoar por 2 sec. O Paladino só pode ter um Selo ativo por vez.\n\n Ao liberar a energia do Selo, o inimigo será julgado por 10 sec, ficando impedido de fugir. Seus ataques corpo a corpo renovam a duração do feitiço. Os inimigos só podem ter um Julgamento de cada Paladino por vez."},
[20165] = {name = "Selo da Luz", additional_info = "110 de Mana\nInstantâneo\n[q]O Paladino recebe a luz divina por 30 sec, fazendo com que cada ataque corpo a corpo tenha chance de restaurar 39 pontos de vida. O Paladino só pode ter um Selo ativo por vez.\n\n Ao liberar a energia do Selo, o inimigo será julgado por 10 sec, fazendo com que ataques corpo a corpo contra ele tenham a chance de restaurar 25 pontos de vida do agressor. Seus ataques corpo a corpo renovam a duração desse feitiço. Os inimigos só podem ter um Julgamento de cada Paladino por vez."},
[20166] = {name = "Selo da Sabedoria", additional_info = "135 de Mana\nInstantâneo\n[q]O Paladino recebe a sabedoria divina por 30 sec, fazendo com que cada ataque corpo a corpo tenha chance de restaurar 50 pontos de mana. O Paladino só pode ter um Selo ativo por vez.\n\n Ao liberar a energia do Selo, o inimigo será julgado por 10 sec, fazendo com que ataques e feitiços usados contra ele tenham a chance de restaurar 33 pontos de mana do agressor. Seus ataques corpo a corpo renovam a duração desse feitiço. Os inimigos só podem ter um Julgamento de cada Paladino por vez."},
