[21082] = {name = "Selo do Cruzado", additional_info = "25 de Mana\nInstantâneo\n[q]O Paladino é agraciado com o espírito de um cruzado por 30 sec, aumentando em 36 o Poder de Ataque Corpo a Corpo. Também aumenta em 40% a velocidade de ataque, mas cada golpe causa menos dano. O Paladino só pode ter um Selo ativo por vez.\n\n Ao liberar a energia do Selo, o inimigo será julgado por 10 sec, aumentando em até 20 o dano Sagrado recebido. Seus ataques corpo a corpo renovam a duração desse feitiço. Os inimigos só podem ter um Julgamento de cada Paladino por vez."},
