[24669] = {name = "Chuva de Fogo", additional_info = "{250 de Mana} {Alcance de 30m}\nCanalizado (10 seg de lançamento)\n[q]Convoca uma chuva derretida, queimando todos os inimigos em uma área selecionada. Causa 500 de dano de Fogo a cada 2 s por 10 sec."},
