[24858] = {name = "Forma de Luniscante", additional_info = "35% de base mana\nInstantâneo\n[q]Transforma o Druida na Forma de Luniscante. Nela, a contribuição de armadura de itens aumenta em 360%\n\nS03 - Tuning and Overrides Passive - Druid\nFogo Lunar custa 50% menos mana e causa 100% a mais de dano ao longo do tempo, seus feitiços de dano periódico podem causar dano periódico crítico, você ganha ( 60 * 2) de dano mágico\n\n e todos os integrantes do grupo em um raio de 30 m têm a chance de acerto crítico com feitiços aumentada em 3%.\n\nS03 - Tuning and Overrides Passive - Druid\nO Luniscante só pode lançar feitiços de cura durante a metamorfose\n\n O Luniscante só pode lançar feitiços de Equilíbrio durante a metamorfose. Reduz em 0% todo o dano de feitiços Arcanos e de Natureza nesta forma\n\n\n\n O ato de se metamorfosear liberta o lançador de efeitos de polimorfia e efeitos que prejudicam o movimento."},
