[27585] = {name = "[q3]Cinto Pesado de Obsidiana", additional_info = "1 min de lançamento\nFerramentas: Martelo de Ferreiro\nReagentes:\nPequeno Estilhaço de Obsidiana (14), Barra de Tório Encantado (4), Essência da Terra (2)\n[q3]Cinto Pesado de Obsidiana\nVincula-se quando equipado\nCintura Placas\n397 Armadura\n+25 Força\nDurabilidade 45 / 45\n60\n[q2]Equipar: +5 para todas as resistências."},
[27586] = {name = "[q4]Escudo Serrilhado Obsidiano", additional_info = "1 min de lançamento\nFerramentas: Martelo de Ferreiro\nReagentes:\nGrande Estilhaço de Obsidiana (8), Pequeno Estilhaço de Obsidiana (24), Barra de Tório Encantado (8), Essência da Terra (4)\n[q4]Escudo Serrilhado Obsidiano\nVincula-se quando equipado\nMão Secundária Escudo\n2645 Armadura\nBloqueio de 48\nDurabilidade 120 / 120\n60\n[q2]Equipar: Aumenta em 2% a chance de bloquear ataques com o escudo.\n[q2]Equipar: +5 para todas as resistências.\n[q2]Equipar: Quando um alvo é atingido por um feitiço nocivo, o lançador do feitiço tem uma chance de 5% de ser silenciado por 3 sec. (Chance de ativar:5%, 20s de recarga)"},
[27587] = {name = "[q4]Peitoral Grosso de Obsidiana", additional_info = "1 min de lançamento\nFerramentas: Martelo de Ferreiro\nReagentes:\nGrande Estilhaço de Obsidiana (18), Pequeno Estilhaço de Obsidiana (40), Barra de Tório Encantado (12), Essência da Terra (10), Esmeralda Enorme (4)\n[q4]Peitoral Grosso de Obsidiana\nVincula-se quando equipado\nTorso Placas\n814 Armadura\n+38 Força\n+16 Vigor\nDurabilidade 165 / 165\n60\n[q2]Equipar: Quando atingido por um feitiço de dano não periódico, você tem 30% de chance de obter 6 sec de escudo de feitiços que absorve 300 to 500 dessa escola de dano. (Chance de ativar:30%, 10s de recarga)"},
