[28270] = {name = "Polimorfia: Vaca", additional_info = "{150 de Mana} {Alcance de 30m}\n1.5 seg de lançamento\n[q]Transforma o inimigo em vaca, forçando-o a perambular por até 50 sec. Enquanto perambula, a vaca não pode atacar nem lançar feitiços, mas regenera pontos de vida muito rapidamente. Qualquer dano transformará o alvo de volta à forma normal. Apenas um alvo pode estar transformado por vez. Funciona somente em feras, humanoides e bichos."},
[28271] = {name = "Polimorfia", additional_info = "{150 de Mana} {Alcance de 30m}\n1.5 seg de lançamento\n[q]Transforma o inimigo em tartaruga, forçando-o a perambular por até 50 sec. Enquanto perambula, a tartaruga não pode atacar nem lançar feitiços, mas se regenera muito rapidamente. Qualquer dano transformará o alvo de volta ao normal. Somente um alvo pode estar transformado por vez. Funciona somente em Feras, Humanoides e Bichos."},
[28272] = {name = "Polimorfia", additional_info = "{150 de Mana} {Alcance de 30m}\n1.5 seg de lançamento\n[q]Transforma o inimigo em porco, forçando-o a perambular por até 50 sec. Enquanto perambula, o porco não pode atacar nem lançar feitiços, mas se regenera muito rapidamente. Qualquer dano transformará o alvo de volta ao normal. Somente um alvo pode ser transformado por vez. Funciona somente em Feras, Humanoides e Bichos."},
