[398196] = {name = "Saque Rápido", additional_info = "{25 de Energia} {Alcance de 20m}\n{Instantâneo} {10 seg de recarga}\nRequer Arma de Longo Alcance\n[q]Saca a arma de longo alcance e dispara um tiro rápido contra um inimigo, causando o dano normal da arma de longo alcance e reduzindo em 50% a velocidade de movimento do alvo por 6 sec. Concede 1 ponto de combo.\n\n Saque Rápido se beneficia de todos os talentos e efeitos que acionam ou modificam o Golpe Sinistro."},
[398197] = {name = "Saque Rápido", additional_info = "[q]Ganha a habilidade Saque Rápido:\n\n\nSaca a arma de longo alcance e dispara um tiro rápido contra um inimigo, causando o dano normal da arma de longo alcance e reduzindo em 50% a velocidade de movimento do alvo por 6 sec. Concede 1 ponto de combo.\n\n Saque Rápido se beneficia de todos os talentos e efeitos que acionam ou modificam o Golpe Sinistro."},
[398198] = {name = "Tempestade de Espadas", additional_info = "{20 de Energia} {Alcance de 100m}\nInstantâneo\n[q]Golpe final que aumenta sua chance de aparar. Dura mais e concede mais chance de aparar por ponto de combo:\n 1 ponto: 10 segundos, 12% de chance de aparar\n 2 pontos: 15 segundos, 14% de chance de aparar\n 3 pontos: 20 segundos, 16% de chance de aparar\n 4 pontos: 25 segundos, 18% de chance de aparar\n 5 pontos: 30 segundos, 20% de chance de aparar"},
