[399956] = {name = "Mutilar", additional_info = "{40 de Energia} {Alcance corpo a corpo}\nInstantâneo\n[q]Ataca instantaneamente com as duas armas, causando 80% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo.\n\n Mutilar se beneficia de todos os talentos e efeitos que modificam ou são ativados por Punhalada pelas Costas, salvo indicação em contrário."},
[399960] = {name = "Mutilar", additional_info = "Alcance corpo a corpo\nInstantâneo\n[q]Ataca instantaneamente com as duas armas, causando 100% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo."},
[399961] = {name = "Mutilar", additional_info = "Alcance corpo a corpo\nInstantâneo\n[q]Ataca instantaneamente com as duas armas, causando 100% do dano da arma mais $[100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo."},
[399962] = {name = "Mutilar", additional_info = "[q]Concede a habilidade Mutilar:\n\n\nAtaca instantaneamente com as duas armas, causando 80% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo.\n\n Mutilar se beneficia de todos os talentos e efeitos que modificam ou são ativados por Punhalada pelas Costas, salvo indicação em contrário."},
[399963] = {name = "Envenenar", additional_info = "{35 de Energia} {Alcance corpo a corpo}\nInstantâneo\nRequer Arma corpo a corpo\n[q]Golpe final que causa dano de veneno instantâneo com base nas doses de seu Veneno Mortal no alvo. Após o ataque com Envenenar, você aplica, com frequência 75% maior, Veneno Instantâneo por 1 s, mais 1 s adicional por ponto de combo. Uma dose é ativada por ponto de combo:\n 1 dose: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 1 + Attack power * 0.072] de dano\n 2 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 2 + Attack power * 0.144] de dano\n 3 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 3 + Attack power * 0.216] de dano\n 4 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 4 + Attack power * 0.288] de dano\n 5 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 5 + Attack power * 0.36] de dano"},
[399965] = {name = "Mistura Mortífera", additional_info = "[q]Concede várias melhorias para os seus venenos:\n\n Quando você inocula outro veneno no alvo, você também inocula Veneno Mortal.\n\n Se sua arma não tiver um veneno aplicado, ela tem chance de ativar Veneno Instantâneo como se o veneno tivesse sido aplicado.\n\n Veneno Mortal e Veneno Instantâneo agora ganham mais dano do seu Poder de Ataque.\n\n Seu Veneno Mortal agora pode ficar ativo em alvos afetados pelo Veneno Mortal de outro Ladino."},
[399966] = {name = "Habilidade de Runa de Pernas", additional_info = "Instantâneo\n[q]Equipa um item do espaço das Pernas com uma Runa gravada para ativar uma habilidade neste espaço."},
[399967] = {name = "Habilidade de Runa de Mãos", additional_info = "Instantâneo\n[q]Equipa um item do espaço das Mãos com uma Runa gravada para ativar uma habilidade neste espaço."},
[399968] = {name = "Envenenar", additional_info = "[q]Concede a habilidade Envenenar:\n\n\n Golpe final que causa dano de veneno instantâneo com base nas doses de seu Veneno Mortal no alvo. Após o ataque com Envenenar, você aplica, com frequência 75% maior, Veneno Instantâneo por 1 s, mais 1 s adicional por ponto de combo. Uma dose é ativada por ponto de combo:\n 1 dose: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 1 + Attack power * 0.072] de dano\n 2 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 2 + Attack power * 0.144] de dano\n 3 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 3 + Attack power * 0.216] de dano\n 4 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 4 + Attack power * 0.288] de dano\n 5 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100) * 5 + Attack power * 0.36] de dano"},
[399969] = {name = "Mistura Mortífera", additional_info = "[q]Concede a habilidade Mistura Mortífera:\n\n\n Concede várias melhorias para os seus venenos:\n\n Quando você inocula outro veneno no alvo, você também inocula Veneno Mortal.\n\n Se sua arma não tiver um veneno aplicado, ela tem chance de ativar Veneno Instantâneo como se o veneno tivesse sido aplicado.\n\n Veneno Mortal e Veneno Instantâneo agora ganham mais dano do seu Poder de Ataque.\n\n Seu Veneno Mortal agora pode ficar ativo em alvos afetados pelo Veneno Mortal de outro Ladino."},
[399985] = {name = "Golpe Sombrio", additional_info = "{20 de Energia} {Alcance de 25m}\nInstantâneo\nRequer Arma corpo a corpo\nRequer Furtividade\n[q]Você se teleporta para trás de seu alvo e golpeia, causando ao alvo 150% do dano da arma. Precisa estar furtivo. Concede 1 ponto de combo."},
[399986] = {name = "Lançar Shuriken", additional_info = "{30 de Energia} {Alcance de 25m}\n{Instantâneo} {20 seg de recarga}\n[q]Lança um shuriken contra seu inimigo, causando dano equivalente a 50% do seu Poder de Ataque, e também acerta até 4 alvos próximos adicionais. Concede 1 ponto de combo por alvo atingido."},
[400012] = {name = "Dança de Lâminas", additional_info = "{25 de Energia} {Alcance de 100m}\nInstantâneo\n[q]Golpe de finalização que aumenta em 10% sua chance de aparar e concede 4 de Poder de Ataque para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura mais a cada ponto de combo.\n\n 1 ponto: 14 segundos\n 2 pontos: 18 segundos\n 3 pontos: 22 segundos\n 4 pontos: 26 segundos\n 5 pontos: 30 segundos"},
[400014] = {name = "Só Um Arranhão", additional_info = "[q]Você recebe dano Físico reduzido em 20% enquanto Dança de Lâminas está ativa. Além disso, sua chance de sofrer um acerto crítico de ataques corpo a corpo é reduzida em 6%, você causa 20% menos dano, a ameaça gerada por todas as suas ações é imensamente aumentada e sua habilidade Finta é substituída por Caçoar, que Provoca o alvo a atacar você.\n\n\nProvoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você."},
[400015] = {name = "Adaptar à Situação", additional_info = nil},
[400016] = {name = "Adaptar à Situação", additional_info = "[q]Cada vez que você Apara ou se Esquiva, você ganha 6% a mais de vida. Acumula até 5 vezes."},
[400024] = {name = "Escapar da Morte", additional_info = "Instantâneo\n[q]Qualquer ataque que mataria você, em vez disso reduzirá seus pontos de vida a 10% de seu máximo de pontos de vida. Além disso, todo dano recebido será reduzido em até 90% por 3 sec. Este efeito não pode ocorrer mais de uma vez por minuto."},
[400029] = {name = "Passo Furtivo", additional_info = "Alcance de 25m\n{Instantâneo} {30 seg de recarga}\n[q]Tenta caminhar pelo plano elemental das sombras e reaparecer atrás do seu inimigo. Aumenta em 70% a velocidade de movimento por 3 sec."},
