[400080] = {name = "Gravar Peitoral - Mistura Mortífera", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Mistura Mortífera:\n\n\n Concede várias melhorias para os seus venenos:\n\n Quando você inocula outro veneno no alvo, você também inocula Veneno Mortal.\n\n Se sua arma não tiver um veneno aplicado, ela tem chance de ativar Veneno Instantâneo como se o veneno tivesse sido aplicado.\n\n Veneno Mortal e Veneno Instantâneo agora ganham mais dano do seu Poder de Ataque.\n\n Seu Veneno Mortal agora pode ficar ativo em alvos afetados pelo Veneno Mortal de outro Ladino."},
[400082] = {name = "Gravar Peitoral - Só Um Arranhão", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Só Um Arranhão:\n\n\nVocê recebe dano Físico reduzido em 20% enquanto Dança de Lâminas está ativa. Além disso, sua chance de sofrer um acerto crítico de ataques corpo a corpo é reduzida em 6%, você causa 20% menos dano, a ameaça gerada por todas as suas ações é imensamente aumentada e sua habilidade Finta é substituída por Caçoar, que Provoca o alvo a atacar você.\n\n\nProvoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você."},
[400093] = {name = "Gravas Botas - Adaptar à Situação", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Adaptar à Situação:\n\n\nCada vez que você Apara ou se Esquiva, você ganha 6% a mais de vida. Acumula até 5 vezes."},
[400094] = {name = "Gravar Luvas - Mutilar", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Mutilar:\n\n\nAtaca instantaneamente com as duas armas, causando 80% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 80 / 100] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo.\n\n Mutilar se beneficia de todos os talentos e efeitos que modificam ou são ativados por Punhalada pelas Costas, salvo indicação em contrário."},
[400095] = {name = "Gravar Peitoral - Saque Rápido", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Saque Rápido:\n\n\nSaca a arma de longo alcance e dispara um tiro rápido contra um inimigo, causando o dano normal da arma de longo alcance e reduzindo em 50% a velocidade de movimento do alvo por 6 sec. Concede 1 ponto de combo.\n\n Saque Rápido se beneficia de todos os talentos e efeitos que acionam ou modificam o Golpe Sinistro."},
[400096] = {name = "Gravar Cinto - Lançar Shuriken", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Lançar Shuriken:\n\n\nLança um shuriken contra seu inimigo, causando dano equivalente a 50% do seu Poder de Ataque, e também acerta até 4 alvos próximos adicionais. Concede 1 ponto de combo por alvo atingido."},
[400099] = {name = "Gravar Calça - Dança de Lâminas", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Dança de Lâminas:\n\n\nGolpe de finalização que aumenta em 10% sua chance de aparar e concede 4 de Poder de Ataque para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura mais a cada ponto de combo.\n\n 1 ponto: 14 segundos\n 2 pontos: 18 segundos\n 3 pontos: 22 segundos\n 4 pontos: 26 segundos\n 5 pontos: 30 segundos"},
