[400573] = {name = "Impacto Arcano", additional_info = "{Instantâneo} {3 min de recarga}\n[q]Ataca o alvo com energia, causando dano Arcano. Cada vez que você lançar Impacto Arcano, o dano e a cura de todos os outros feitiços Arcanos serão aumentados em 15%, e o custo de mana de Impacto Arcano aumentará em 175%. O efeito acumula até 4 vezes e dura 6 sec."},
[400574] = {name = "Impacto Arcano", additional_info = "{7% de base mana} {Alcance de 30m}\n2.5 seg de lançamento\n[q]Ataca o alvo com energia, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] de dano Arcano. Cada vez que você lançar Impacto Arcano, o dano e a cura de todos os outros feitiços Arcanos serão aumentados em 15%, e o custo de mana de Impacto Arcano aumentará em 175%. O efeito acumula até 4 vezes. Dura 6 sec ou até que qualquer outro feitiço de dano Arcano ou cura seja lançado."},
[400586] = {name = "Impacto Arcano", additional_info = "{Instantâneo} {3 min de recarga}\n[q]Ataca o alvo com energia, causando dano Arcano. Cada vez que você lançar Impacto Arcano, o dano de todos os outros feitiços Arcanos será aumentado em 15%, e o custo de mana de Impacto Arcano aumentará em 175%. O efeito acumula até 4 vezes e dura 6 sec."},
[400588] = {name = "Salva de Mísseis", additional_info = "[q]Concede ao seu Impacto Arcano 40% de chance, e aos seus feitiços Bola de Fogo e Seta de Gelo 20% de chance de reduzir em 50% a duração canalizada de seu próximo feitiço Mísseis Arcanos, de reduzir em 100% o custo de mana, e de que os mísseis sejam disparados a cada 0,5 s.\n(Chance de ativar:50%)"},
[400589] = {name = "Salva de Mísseis", additional_info = "Instantâneo\n[q]Concede aos seus feitiços Impacto Arcano, Bola de Fogo e Seta de Gelo a chance de reduzir em 50% a duração canalizada do próximo Mísseis Arcanos, reduzir em 100% o custo de mana e disparar mísseis a cada 0,5 s."},
[400610] = {name = "Salva Arcana", additional_info = "{8% de base mana} {Alcance de 30m}\n{Instantâneo} {3 seg de recarga}\n[q]Lança vários mísseis contra o alvo inimigo, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 358 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 438 / 100] de dano Arcano. Este feitiço também tem 25% de chance de ativar a Salva de Mísseis."},
[400613] = {name = "Bomba Viva", additional_info = "{22% de base mana} {Alcance de 35m}\nInstantâneo\n[q]O alvo se torna uma Bomba Viva, recebendo [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] de dano de Fogo ao longo de 12 sec. Depois de 12 sec ou quando o feitiço for dissipado, o alvo explode, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] de dano de Fogo a todos os inimigos em um raio de 10 m."},
[400614] = {name = "Bomba Viva", additional_info = "Alcance de 100m\nInstantâneo\n[q]O alvo se torna uma Bomba Viva, recebendo [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] de dano de Fogo ao longo de until cancelled. Depois de until cancelled ou quando o feitiço for dissipado, o alvo explode, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] de dano de Fogo a todos os inimigos em um raio de 10 m."},
[400615] = {name = "Superaquecimento", additional_info = "[q]Impacto de Fogo sempre acertará criticamente, pode ser lançado durante o lançamento de outro feitiço e não é afetado pela recarga global, mas tem a recarga aumentada em 15 s."},
[400616] = {name = "Impacto de Fogo", additional_info = "{115 de Mana} {Alcance de 20m}\n{Instantâneo} {15 seg de recarga}\n[q]Atinge o inimigo, causando 110 to 134 de dano de Fogo."},
[400618] = {name = "Impacto de Fogo", additional_info = "{40 de Mana} {Alcance de 20m}\n{Instantâneo} {15 seg de recarga}\n[q]Atinge o inimigo, causando 27 to 35 de dano de Fogo."},
