[400624] = {name = "Embalo de Fogo", additional_info = "[q]Sempre que você obtiver 2 acertos críticos em sequência com feitiços não periódicos usando Bola de Fogo, Seta de Fogofrio, Seta Incendiária, Impacto de Fogo, Calcinar ou Bomba Viva, seu próximo Ignimpacto lançado em 10 sec será instantâneo e custará 100% a menos de mana."},
[400625] = {name = "Embalo de Fogo", additional_info = "Instantâneo\n[q]Sempre que obtiver 2 acertos críticos em sequência com feitiços não periódicos usando Bola de Fogo, Impacto de Fogo, Calcinar, Bomba Viva, Fogo Místico ou Seta de Fogofrio, por 10 sec você tem chance de lançar instantaneamente seu próximo Ignimpacto."},
[400640] = {name = "Lança de Gelo", additional_info = "{8% de base mana} {Alcance de 30m}\nInstantâneo\n[q]Causa de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100 * ( 1 ) ] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100 * ( 1 ) ] de dano de Gelo a um alvo inimigo. Causa dano triplicado contra alvos Congelados."},
[400647] = {name = "Dedos Glaciais", additional_info = "[q]Concede aos seus efeitos de Calafrio 15% de chance de conceder o efeito Dedos Glaciais a você, fazendo seus próximos 2 feitiços lançados tratarem o alvo como se ele estivesse congelado. Dura 15 sec."},
[400669] = {name = "Dedos Glaciais", additional_info = "Instantâneo\n[q]Concede aos seus efeitos de Gelar chance de conceder o efeito Dedos Glaciais a você, que trata seus próximos feitiços lançados como se o alvo estivesse congelado. Dura 15 sec."},
