[400730] = {name = "Bola de Fogo!", additional_info = "Instantâneo\n[q]O seu próximo feitiço Bola de Fogo, Seta de Gelo Mágico, Seta Incendiária ou Seta de Fogofrio será instantâneo e não gastará mana.\n[q]Modifies Power Cost -999%:\nBola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Seta de Fogofrio\n\nModifies Cast Time -9999%:\nBola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Bola de Fogo , Seta de Fogofrio"},
[400731] = {name = "Congelamento Cerebral", additional_info = "[q]Seus feitiços de dano de Gelo que causam efeitos enregelantes têm 20% de chance de fazer com que o lançamento do seu próximo feitiço Bola de Fogo, Seta de Gelo Mágico, Seta Incendiária ou Seta de Fogofrio seja instantâneo e não custe mana.\n(Chance de ativar:20%)"},
[400735] = {name = "Foco Temporal", additional_info = "Alcance de 100m\nInstantâneo\n[q]Grava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[401405] = {name = "Cura Cronomântica", additional_info = nil},
[401417] = {name = "Regeneração", additional_info = "{28% de base mana} {Alcance de 40m}\nCanalizado (3 seg de lançamento)\n[q]Cura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida do alvo ao longo de 3 sec e aplica um Foco Temporal por 30 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[401460] = {name = "Regeneração Rápida", additional_info = "{32% de base mana} {Alcance de 40m}\nCanalizado (1.5 seg de lançamento)\n[q]Cura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 75 / 100 * 3] pontos de vida do alvo ao longo de 1.50 sec e aplica um Foco Temporal por 20 s.\n\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[401462] = {name = "Retroceder Tempo", additional_info = "Alcance de 60m\n{Instantâneo} {30 seg de recarga}\n[q]Seu alvo atual com um Foco Temporal recupera instantaneamente todo o dano sofrido nos últimos 5 s. Não funciona em alvos que não tinham um Foco Temporal 5 s atrás."},
