[401724] = {name = "Embalo de Fogo", additional_info = "[q]Concede a habilidade Embalo de Fogo:\n\n\nSempre que você obtiver 2 acertos críticos em sequência com feitiços não periódicos usando Bola de Fogo, Seta de Fogofrio, Seta Incendiária, Impacto de Fogo, Calcinar ou Bomba Viva, seu próximo Ignimpacto lançado em 10 sec será instantâneo e custará 100% a menos de mana."},
