[401726] = {name = "Proteção Avançada", additional_info = "[q]Concede a habilidade Proteção Avançada:\n\n\nSeus feitiços Escudo de Mana, Proteção contra Gelo e Proteção contra Fogo agora podem ser lançados em qualquer alvo aliado e absorvem 100% a mais de dano, com Escudo de Mana consumindo 50% menos pontos de mana por ponto de dano absorvido. Além disso, seu Remover Maldição Inferior é substituído por Remover Maldição Superior.\n\n\nRemove 1 Maldição e 1 efeito mágico nocivo de um alvo aliado."},
[401729] = {name = "Impacto Arcano", additional_info = "[q]Concede a habilidade Impacto Arcano:\n\n\nAtaca o alvo com energia, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] de dano Arcano. Cada vez que você lançar Impacto Arcano, o dano e a cura de todos os outros feitiços Arcanos serão aumentados em 15%, e o custo de mana de Impacto Arcano aumentará em 175%. O efeito acumula até 4 vezes. Dura 6 sec ou até que qualquer outro feitiço de dano Arcano ou cura seja lançado."},
[401731] = {name = "Bomba Viva", additional_info = "[q]Concede a habilidade Bomba Viva:\n\n\nO alvo se torna uma Bomba Viva, recebendo [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] de dano de Fogo ao longo de 12 sec. Depois de 12 sec ou quando o feitiço for dissipado, o alvo explode, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] de dano de Fogo a todos os inimigos em um raio de 10 m."},
