[403470] = {name = "Gravar Luvas - Ímpeto da Vitória", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Ímpeto da Vitória:\n\n\nAtaca instantaneamente o alvo, causando (1 + Attack power * 45 / 100) de dano e concedendo a você uma cura equivalente a 30% do seu máximo de pontos de vida. Só é possível usar em até 20 sec após matar um inimigo que conceda experiência ou honra."},
[403472] = {name = "Gravar Botas - Comprar Briga", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Comprar Briga:\n\n\nCorra em alta velocidade em direção a um membro do grupo, interceptando o próximo ataque corpo a corpo ou de longo alcance realizado contra ele e reduzindo em 10% a ameaça total dele."},
[403474] = {name = "Gravar Peitoral - Frenesi de Sangue", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava no peitoral a runa de Frenesi de Sangue:\n\n\nDilacerar agora pode ser usado na postura do Berserker, dano de Dilacerar aumentado em 100%, e Dilacerar causa dano adicional equivalente a 3% do seu Poder de Ataque sempre que causa dano."},
[403475] = {name = "Gravar Luvas - Devastar", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Devastar:\n\n\nQuando você está em Postura de Defesa e tem um escudo equipado, Fender Armadura também causa dano equivalente a 150% do dano da sua arma equipada por segundo, aumentado em 10% por aplicação de Fender Armadura já existente no alvo. O dano de Devastar gera uma quantidade elevada de ameaça quando você está em Postura de Defesa."},
[403476] = {name = "Gravar Calça - Trovão Furioso", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Trovão Furioso:\n\n\nTrovoada agora aumenta o intervalo entre ataques em mais 6%, pode ser usada em qualquer postura, causa 100% a mais de dano e aumenta em 50% a ameaça."},
[403480] = {name = "Gravar Peitoral - Flagelação", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava no peitoral a runa de Flagelação:\n\n\nVocê ganha Raiva de dano Físico recebido como se não estivesse usando armadura."},
[403489] = {name = "Gravar Elmo - Raiva Infinita", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Raiva Infinita:\n\n\nVocê gera 25% a mais de Raiva ao causar qualquer dano."},
[403501] = {name = "Assombrar", additional_info = "{12% de base mana} {Alcance de 30m}\n{Instantâneo} {12 seg de recarga}\n[q]Libera uma alma fantasmagórica em um inimigo, causando [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100] a [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100] de dano e aumentando em 20% todo o dano de Sombra causado no alvo ao longo do tempo. Quando Assombrar acaba ou é dissipado, você recebe uma cura equivalente ao dano que você causou no alvo."},
[403506] = {name = "Assombrar", additional_info = nil},
[403511] = {name = "Sifão da Alma", additional_info = "[q]Faz seu Drenar Vida causar dano 3 vezes mais rápido e aumenta em mais 6% a vida drenada pelos seus feitiços Drenar Vida e Drenar Alma para cada efeito de Sombra de Bruxo afetando o alvo, até um máximo de 18% de efeito adicional. Quando o feitiço Drenar Alma é lançado em um alvo com menos de 20% do total de pontos de vida, ele recebe 50% por efeito, até um máximo de 150%. Além disso, seu Drenar Alma agora pode ativar seu talento Ocaso.\n(Chance de ativar:8%)"},
[403619] = {name = "Armadura Vil", additional_info = "28% de base mana\nInstantâneo\n[q]Envolve o lançador em energia vil, aumentando em 1 o dano mágico e a cura, e concede dano mágico e cura adicionais equivalentes a 50% do seu Espírito. Além disso, você regenera 2% do seu máximo de pontos de vida a cada 5 s. Somente um tipo de feitiço de Armadura pode estar ativo no Bruxo por vez. Dura 30 min."},
[403628] = {name = "Salva de Setas Sombrias", additional_info = "[q]Seta Sombria agora atinge até 5 alvos dentro de uma distância de encadeamento de 10 m, mas com 5% a menos de dano."},
[403629] = {name = "Seta do Caos", additional_info = "{7% de base mana} {Alcance de 30m}\n{2.5 seg de lançamento} {12 seg de recarga}\n[q]Atira uma seta de fogo caótico contra o inimigo, causando [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 522 / 100] a [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 662 / 100] de dano de Fogo. A Seta do Caos sempre acerta, não pode ser resistida, e seu conhecimento faz todos os feitiços de Fogo penetrarem todos os efeitos de absorção. A Seta do Caos tem alta chance de ser resistida quando usada contra monstros que tenham quatro ou mais níveis acima do seu."},
[403630] = {name = "Seta do Caos", additional_info = nil},
[403650] = {name = "Lago de Fogo", additional_info = "Alcance de 100m\nInstantâneo\n[q]Chuva de Fogo também deixa um Lago de Fogo no chão, que aumenta em 50% todo o dano de Fogo que você e seu demônio ajudante causam aos inimigos afetados."},
[403666] = {name = "Lago de Fogo", additional_info = "[q]Sua Chuva de Fogo não está mais canalizada, mas ganha uma recarga de 8 s."},
[403668] = {name = "Mestre Canalizador", additional_info = "[q]Drenar Vida não é mais canalizado, dura 15 sec com recarga de 15 sec, custa 100% mais mana e cura 50% a mais cada vez que causa dano."},
[403677] = {name = "Drenar Vida", additional_info = "{110 de Mana} {Alcance de 20m}\n{Instantâneo} {15 seg de recarga}\n[q]Transfere 10 pontos de vida a cada segundo do alvo para o lançador. Dura 15 sec."},
