[403789] = {name = "Metamorfose", additional_info = "100% de base mana\nInstantâneo\n[q]Transforma-se em Demônio, aumentando em 500% a Armadura, reduzindo em 6% a chance de receber acertos críticos, aumentando em 77% a ameaça, aumentando em 100% o mana concedido por Conversão de Vida, mas reduzindo em 15% todo o dano que você causa. Metamorfose transforma a funcionalidade de algumas habilidades e concede algumas novas:\n\n Dor Lancinante: agora é instantânea.\n\n Seta Sombria: vira Cutilada Sombria, um ataque corpo a corpo de Sombra que atinge até 10 inimigos próximos, mas tem recarga de 6 s.\n\n Medo: substituído por Ameaça.\n\n\nProvoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Investida Demoníaca\n\n\nInveste contra um inimigo e o atordoa por 1 sec. Não pode ser usado em combate.\n\n Uivo Demoníaco\n\n\nForça todos os inimigos próximos a concentrarem os ataques em você por 6 sec."},
[403816] = {name = "Metamorfose", additional_info = "[q]Transforma em Demônio, aumentando em 500% a Armadura, reduzindo em 6% a chance de receber acertos críticos, aumentando em 77% a ameaça, aumentando em 100% o mana ganho de Conversão de Vida e transformando a funcionalidade de algumas das suas habilidades:\n\n Dor Lancinante: agora é instantânea.\n\n Seta Sombria: vira Cutilada Sombria, um ataque corpo a corpo de Sombra que atinge até 500 inimigos próximos.\n\n Maldição da Temeridade: agora também provoca o alvo a atacar você por until cancelled.\n\n Uivo do Terror: agora também força todos os inimigos próximos a atacar você por until cancelled, mas a recarga aumenta para 10 min."},
[403828] = {name = "Ameaça", additional_info = "Alcance corpo a corpo\n{Instantâneo} {10 seg de recarga}\n[q]Provoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você."},
[403835] = {name = "Cutilada Sombria", additional_info = "{12 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\n[q]Ataca até 10 inimigos próximos com uma chicotada Sombria, causando 3 to 7 de dano a cada um deles.\n\n Cutilada Sombria aciona e se beneficia da maioria dos talentos e efeitos que acionam e beneficiam Seta Sombria.\n\nS03 - Tuning and Overrides Passive - All Classes\nAcertar um alvo com Cutilada Sombria também concede 2 de dano mágico para cada ponto da sua habilidade de defesa acima de ( 5 * 5). Dura 15 sec"},
