[407613] = {name = "Foco de Luz", additional_info = "{7% de base mana} {Alcance de 40m}\nInstantâneo\n[q]O alvo se torna um Foco de Luz para todos os integrantes do raide ou grupo num raio de 40 m. Qualquer cura que você lançar nos integrantes do raide ou grupo também cura o Foco em 75% do total curado. Somente um alvo pode ser o Foco de Luz por vez. Dura 1 hour."},
[407614] = {name = "Foco de Luz", additional_info = "Alcance de 60m\nInstantâneo\n[q]O alvo se torna um Foco de Luz para todos os alvos num raio de 60 m. Qualquer cura que você lançar nos alvos também cura o Foco em 75% do total curado."},
[407615] = {name = "Foco de Luz", additional_info = "Alcance de 40m\nInstantâneo\n[q]O alvo se torna um Foco de Luz para todos os alvos num raio de 40 m. Qualquer cura que você lançar nos alvos também cura o Foco em 1% do total curado. Somente um alvo pode ser o Foco de Luz por vez. Dura until cancelled."},
[407624] = {name = "Proficiência em Auras", additional_info = "{Instantâneo} {2 min de recarga}\n[q]Faz sua Aura de Concentração deixar todos os alvos afetados imunes a efeitos de silêncio e interrupção, aumentando em 100% o efeito de todas as outras auras. Dura 6 sec."},
[407627] = {name = "Fúria Íntegra", additional_info = "Instantâneo\n[q]Aumenta em 80% a ameaça gerada pelos seus feitiços Sagrados e concede a você mana equivalente a 25% do total curado por feitiços de cura de outros alvos aliados. Além disso, dano que deixe você com menos de 35% dos pontos de vida é reduzido em 20%. Dura until cancelled."},
[407628] = {name = "Fúria Íntegra", additional_info = "Instantâneo\n[q]Ganhando mana ao receber cura."},
[407631] = {name = "Mão da Desforra", additional_info = "Alcance corpo a corpo\n{Instantâneo} {10 seg de recarga}\n[q]Provoca o alvo a atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Enquanto você souber esta habilidade, o bônus de ameaça de Fúria Íntegra é aumentado em 80% e faz você ganhar mana equivalente a 25% do total curado. Além disso, enquanto a Fúria Íntegra está ativa, dano que deixe você com menos de 35% dos pontos de vida é reduzido em 20%. Fúria Íntegra permanece ativa até ser cancelada."},
[407632] = {name = "Martelo do Íntegro", additional_info = "{6% de base mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\n[q]Martela o alvo atual e até 2 alvos próximos adicionais, causando dano Sagrado equivalente a 3 vezes do seu dano com a mão principal por segundo."},
[407653] = {name = "Raio Bifurcado", additional_info = "Alcance de 30m\nInstantâneo\n[q]Atinge um inimigo com um raio que se propaga até outro inimigo próximo. O feitiço afeta até 0 alvos, causando dano de Natureza a cada um deles."},
[407667] = {name = "Raio Bifurcado", additional_info = "Alcance de 30m\nInstantâneo\n[q]Atinge um inimigo com um raio que se propaga para todos os alvos próximos, causando dano de Natureza a eles."},
[407669] = {name = "Escudo do Vingador", additional_info = "{26% de base mana} {Alcance de 30m}\n{Instantâneo} {15 seg de recarga}\n[q]Atira um escudo sagrado contra o inimigo, causando [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] a [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] de dano Sagrado e estonteando-o para, então, pular para os inimigos próximos. Afeta um total de 3 alvos. Dura 5 sec."},
[407676] = {name = "Golpe do Cruzado", additional_info = "Alcance corpo a corpo\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um golpe instantâneo que causa dano Sagrado equivalente a 75% do dano da arma e regenera 5% do seu máximo de pontos de mana. A duração de todos os efeitos de Julgamento no alvo é renovada a cada 30 s."},
[407720] = {name = "Raio Bifurcado", additional_info = "Alcance de 30m\nInstantâneo\n[q]Atinge um inimigo com um raio que se propaga até outro inimigo próximo. O feitiço afeta até 0 alvos, causando dano de Natureza a cada um deles."},
[407736] = {name = "Raio Bifurcado", additional_info = "Alcance de 30m\nInstantâneo\n[q]Atinge um inimigo com um raio que se propaga até outro inimigo próximo. O feitiço afeta até 0 alvos, causando dano de Natureza a cada um deles."},
