[407778] = {name = "Tempestade Divina", additional_info = "12% de base mana\n{Instantâneo} {10 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um ataque de arma instantâneo que causa 110% do dano da arma a até 4 inimigos em um raio de 8 m. A Tempestade Divina cura até 3 integrantes do grupo ou raide, totalizando 25% do dano causado."},
[407782] = {name = "Tempestade Divina", additional_info = "Alcance de 100m\nInstantâneo\n[q]Dano de Tempestade Divina cura alvos aliados."},
[407784] = {name = "Tempestade Divina", additional_info = "Alcance ilimitado\nInstantâneo\n[q]O dano causado por Tempestade Divina cura alvos aliados próximos."},
[407788] = {name = "Ira Vingativa", additional_info = "8% de base mana\n{Instantâneo} {3 min de recarga}\n[q]Aumenta em 20% todo dano causado e cura realizada por 20 sec. Causa Abstinência e não é possível usar com a Abstinência ativa."},
[407791] = {name = "Ira de Aku'mai", additional_info = "Instantâneo\n[q]Aumenta em 25 o dano Físico causado pelo lançador e em 30% a velocidade de ataque dele por 15 sec."},
[407794] = {name = "Perfuração Tripla", additional_info = "Alcance corpo a corpo\nInstantâneo\n[q]Causa dano Físico a um inimigo a cada 3 s por 15 sec.\n(1s de recarga)"},
[407798] = {name = "Selo do Martírio", additional_info = "4% de base mana\nInstantâneo\n[q]Preenche você com espírito sagrado por 30 sec, fazendo cada um dos seus ataques corpo a corpo causar 50% do dano da arma ao seu alvo, mas você perde vida equivalente a 10% do dano causado. Enquanto o selo estiver ativo, integrantes do grupo ou raide em um raio de 40 m ganham pontos de mana equivalentes a 65% do dano que você recebe deste selo.\n\n Liberar a energia do Selo julga um inimigo, causando instantaneamente 85% do dano da arma a um custo de pontos de vida equivalentes a 10% do dano causado.\n\n O Selo e o Julgamento desta habilidade se beneficiam de talentos e efeitos que modificam o Selo ou o Julgamento do Selo da Retidão."},
[407799] = {name = "Selo do Martírio", additional_info = nil},
[407800] = {name = "Selo do Martírio", additional_info = "Instantâneo\n[q]Dano de Selo do Martírio também causa dano ao Paladino."},
[407802] = {name = "Selo do Martírio", additional_info = "Alcance de 40m\nInstantâneo\n[q]Ganhando mana a partir do dano recebido pelo Paladino."},
[407803] = {name = "Julgamento do Martírio", additional_info = nil},
[407804] = {name = "Sacrifício Divino", additional_info = "{Instantâneo} {2 min de recarga}\n[q]30% de todo dano recebido pelos integrantes do grupo que estejam em um raio de 30 m é redirecionado para o Paladino por 10 sec. Qualquer dano que reduza os pontos de vida do Paladino para menos de 20% interrompem o efeito e concedem ao Paladino 10% a mais de dano e cura por 10 sec. Sacrifício Divino não pode ser usado quando você está sob efeito de Bênção de Proteção, Escudo Divino ou Proteção Divina, e impede você de ser alvo dessas habilidades quando está ativo."},
[407805] = {name = "Sacrifício Redimido", additional_info = "{Instantâneo} {3 min de recarga}\n[q]Dano e cura aumentados após o seu sacrifício."},
[407811] = {name = "Cutilada", additional_info = "Alcance corpo a corpo\nPróximo Mão a Mão\n[q]Causa dano da arma mais 23 to 27 a um inimigo e ao aliado mais próximo dele, afetando até 3 alvos."},
