[407880] = {name = "Modelo de Inspiração", additional_info = "2% de base mana\nInstantâneo\n[q]Sua presença inspiradora dissipa periodicamente efeitos de Medo e Sono em integrantes do grupo próximos."},
[407881] = {name = "Modelo de Inspiração", additional_info = "Instantâneo\n[q]Sua presença inspiradora dissipa periodicamente efeitos de Medo e Sono em integrantes do grupo próximos."},
