[407973] = {name = "Golpe Selvagem", additional_info = "Alcance de 100m\nInstantâneo\n[q]Ataque extra."},
[407975] = {name = "Golpes Selvagens", additional_info = "Instantâneo\n[q]Integrantes do grupo em um raio de 20 m obtêm mais ferocidade de combate. Cada ataque corpo a corpo tem 20% de chance de conceder outro ataque com 20% a mais de Poder de Ataque. Sem efeito se o integrante do grupo já se beneficiar do Totem de Fúria dos Ventos.\n(Chance de ativar:20%, 1.5s de recarga)"},
[407977] = {name = "Golpes Selvagens", additional_info = "[q]Enquanto você estiver em Forma de Felino, Forma de Urso ou Forma de Urso Hediondo, integrantes do grupo ou raide em um raio de 100 m obtêm mais ferocidade de combate. Cada ataque corpo a corpo tem 20% de chance de conceder outro ataque com 20% a mais de Poder de Ataque. Sem efeito se o alvo já se beneficiar do Totem de Fúria dos Ventos."},
[407988] = {name = "Rugido Selvagem", additional_info = "{25 de Energia} {Alcance de 100m}\nInstantâneo\n[q]Golpe de finalização que aumenta em 30% o dano físico causado na Forma de Felino. Dura mais a cada ponto de combo.\n 1 ponto: 14 segundos\n 2 pontos: 19 segundos\n 3 pontos: 24 segundos\n 4 pontos: 29 segundos\n 5 pontos: 34 segundos"},
[407989] = {name = "Rugido Selvagem", additional_info = "Instantâneo\nRequer Forma de Felino\n[q]Golpe de finalização que aumenta em 30% o dano Físico causado. Dura mais a cada ponto de combo.\n 1 ponto: 14 segundos\n 2 pontos: 19 segundos\n 3 pontos: 24 segundos\n 4 pontos: 29 segundos\n 5 pontos: 34 segundos"},
[407993] = {name = "Destroçar", additional_info = "{40 de Energia} {Alcance corpo a corpo}\nInstantâneo\nRequer Forma de Felino\n[q]Destroça o alvo, causando 270% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Concede 1 ponto de combo. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa."},
[407995] = {name = "Destroçar", additional_info = "{15 de Raiva} {Alcance corpo a corpo}\n{Conjuração instantânea} {6 seg de recarga}\nRequer Forma de Urso, Forma de Urso Hediondo\n[q]Destroça o alvo, causando 160% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa.\n\n Acertar um alvo com Despedaçar (Urso) também concede 4 de Poder de Ataque para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec."},
[408013] = {name = "Aparição Elite das Profundezas Negras", additional_info = nil},
[408014] = {name = "Aparecimento da Elite das Profundezas Negras", additional_info = nil},
[408024] = {name = "Instintos de Sobrevivência", additional_info = "{Instantâneo} {3 min de recarga}\n[q]Após a ativação, concede 30% do seu máximo de pontos de vida e aumenta em 20% toda a cura não Física que você realiza por 20 sec. Quando o efeito expira, os pontos de vida são perdidos. É possível usar em qualquer forma.\n\n Além disso, você regenera 5 de Raiva a cada esquiva na Forma de Urso ou Urso Hediondo, 10 de energia na Forma de Felino ou 1% do seu máximo de pontos de mana em qualquer outra forma."},
[408025] = {name = "Instintos de Sobrevivência", additional_info = nil},
[408030] = {name = "Runogravura: Aprender a Gravar Sifão da Alma", additional_info = nil},
[408035] = {name = "Deimon Kane - Trocar Almas por Runas", additional_info = nil},
[408120] = {name = "Crescimento Silvestre", additional_info = "{45% de base mana} {Alcance de 40m}\n{Instantâneo} {6 seg de recarga}\n[q]Cura [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de todos os integrantes do grupo do jogador selecionado em um raio de 43.5 m do alvo ao longo de 7 sec. A quantidade curada é aplicada rapidamente no início e fica mais lenta conforme o Crescimento Silvestre chega ao fim da duração."},
[408124] = {name = "Brotar da Vida", additional_info = "{14% de base mana} {Alcance de 40m}\nInstantâneo\n[q]Cura [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida do alvo ao longo de 7 sec. Quando Brotar da Vida expira ou é dissipado, o alvo recebe instantaneamente uma cura de [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida, e o Druida recupera metade do custo do feitiço. Esse efeito pode acumular até 3 vezes no mesmo alvo."},
[408245] = {name = "Brotar da Vida", additional_info = "Alcance de 40m\nInstantâneo\n[q]Cura o alvo ao longo de 7 s. Quando Brotar da Vida expira ou é dissipado, o alvo recebe instantaneamente uma cura. Este efeito pode acumular até 3 vezes no mesmo alvo."},
[408246] = {name = "Brotar da Vida", additional_info = "Instantâneo\n[q]Ganha mana quando Brotar da Vida expira."},
[408247] = {name = "Nutrir", additional_info = "{26% de base mana} {Alcance de 40m}\n2 seg de lançamento\n[q]Cura [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] a [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de um alvo aliado. Cura mais 20% se você tiver um efeito de Rejuvenescer, Recrescimento, Brotar da Vida ou Crescimento Silvestre ativo no alvo. Este feitiço se beneficia de todos os efeitos associados ao Toque de Cura ou Recrescimento e os ativa."},
[408248] = {name = "Eclipse", additional_info = "[q]Fogo Estelar aumenta em 30% a chance de acerto crítico das duas próximas duas Iras, e Ira reduz em 1.0 s o tempo de lançamento do seu próximo Fogo Estelar. Os dois efeitos acumulam até 4 cargas. Os dois feitiços também concedem 70% de chance em todas as situações de não perder tempo de lançamento quando receber dano."},
[408250] = {name = "Eclipse: Solar", additional_info = "Instantâneo\n[q]Chance de acerto crítico aumentada com Ira."},
[408255] = {name = "Eclipse: Lunar", additional_info = nil},
[408258] = {name = "Estado Onírico", additional_info = "[q]Os acertos críticos de feitiços não periódicos que causam dano ou qualquer dano de Surto Estelar concedem 50% da sua regeneração de mana enquanto estiver lançando feitiços por 8 sec e aumenta em 20% os danos de Natureza e Arcano causados ao alvo por 12 sec."},
[408261] = {name = "Estado Onírico", additional_info = "Instantâneo\n[q]Permite que 50% da regeneração de Mana continue enquanto estiver lançando feitiços."},
[408307] = {name = "Fúria da Natureza", additional_info = "{Instantâneo} {2 min de recarga}\n[q]Aumenta o poder de cura em 90% do dano mágico de Natureza por 30 sec."},
[408309] = {name = "Graça de Eluna", additional_info = "{Instantâneo} {2 min de recarga}\n[q]Aumenta o seu dano mágico em 55% da diferença entre o poder de cura e o dano mágico. Dura 30 sec."},
[408339] = {name = "Nova de Fogo", additional_info = "[q]O feitiço Totem de Nova de Fogo é substituído pela Nova de Fogo, o que faz o atual totem de Fogo emitir dano de onde estiver."},
[408341] = {name = "Nova de Fogo", additional_info = "22% de base mana\n{Instantâneo} {10 seg de recarga}\nFerramentas: Totem do Fogo\n[q]Causa instantaneamente 53 to 62 de dano de Fogo a inimigos em um raio de 10 m do totem de Fogo ativo."},
[408342] = {name = "Nova de Fogo", additional_info = "22% de base mana\n{Instantâneo} {10 seg de recarga}\nFerramentas: Totem do Fogo\n[q]Causa instantaneamente 110 to 124 de dano de Fogo a inimigos em um raio de 10 m do totem de Fogo ativo."},
[408343] = {name = "Nova de Fogo", additional_info = "22% de base mana\n{Instantâneo} {10 seg de recarga}\nFerramentas: Totem do Fogo\n[q]Causa instantaneamente 195 to 219 de dano de Fogo a inimigos em um raio de 10 m do totem de Fogo ativo."},
