[408490] = {name = "Estouro de Lava", additional_info = "{10% de base mana} {Alcance de 30m}\n{2 seg de lançamento} {8 seg de recarga}\n[q]Você lança lava derretida contra o alvo, causando [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] a [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] de dano de Fogo. Se o alvo estiver sob o efeito de seu Choque Flamejante, o Estouro de Lava causará um acerto crítico."},
[408491] = {name = "Estouro de Lava", additional_info = "Alcance de 30m\nInstantâneo\n[q]Você lança lava derretida contra o alvo, causando [234 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] a [303 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] de dano de Fogo. Se o alvo estiver sob o efeito de seu Choque Flamejante, o Estouro de Lava causará um acerto crítico."},
[408496] = {name = "Especialização em Duas Armas", additional_info = "[q]Aumenta em 5% a chance de acertar com ataques corpo a corpo e feitiços enquanto estiver empunhando duas armas, a habilidade Ataque da Tempestade agora acerta com ambas as armas e aumenta em 50% o dano causado pela sua arma secundária."},
[408498] = {name = "Arma da Voragem", additional_info = "[q]Quando causar dano com um ataque corpo a corpo, você terá chance de reduzir em 20% o tempo de lançamento e o custo de mana do seu próximo feitiço Raio, Cadeia de Raios, Onda Curativa Menor ou Estouro de Lava. Chance aumentada em 50% quando a arma da mão principal está encantada com Arma de Fúria dos Ventos, e em mais 50% com uma arma de duas mãos. Acumula até 5 vezes. Dura 30 sec."},
[408501] = {name = "Voragem Pronta!", additional_info = nil},
[408505] = {name = "Arma da Voragem", additional_info = "Instantâneo\n[q]Reduz em 20% o tempo de lançamento e o custo de mana de seu próximo feitiço Raio, Cadeia de Raios, Onda Curativa Menor ou Estouro de Lava."},
[408507] = {name = "Açoite de Lava", additional_info = "{1% de base mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Você imbui a sua arma de mão secundária em lava, causando instantaneamente 100% do dano da arma de mão secundária. O dano aumenta em 125% se sua arma de mão secundária estiver encantada com Labareda."},
[408510] = {name = "Escudo de Água", additional_info = "Instantâneo\n[q]O lançador é cercado por 3 globos de água que lhe concedem 1% do máximo de pontos de mana a cada 5 s. Quando um feitiço, ataque corpo a corpo ou de longo alcance atinge o lançador, 4% do máximo de pontos de mana do lançador são restaurados. Isso gasta um globo de água. Um globo é ativado em intervalos de segundos. Dura 10 min. Apenas um Escudo Elemental pode estar ativo no Xamã por vez.\n(3.5s de recarga)"},
[408511] = {name = "Escudo de Água", additional_info = "Instantâneo\n[q]Ganha pontos de mana quando atingido com o Escudo de Água ativo."},
[408514] = {name = "Escudo da Terra", additional_info = "{5% de base mana} {Alcance de 40m}\nInstantâneo\n[q]Protege o alvo aliado com um escudo terreno, reduzindo em 30% o tempo de lançamento ou canalização perdido quando você recebe dano e fazendo com que os ataques recuperem [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] pontos de vida do alvo protegido. Este efeito só pode ocorrer uma vez a cada alguns segundos. 9 cargas. 10 min de duração. Escudo da Terra só pode ser colocado em um alvo de cada vez.\n(3.5s de recarga)"},
[408519] = {name = "Escudo da Terra", additional_info = "Alcance ilimitado\nInstantâneo\n[q]Curado pelo Escudo da Terra."},
[408521] = {name = "Contracorrente", additional_info = "{18% de base mana} {Alcance de 40m}\n{Instantâneo} {6 seg de recarga}\n[q]Cura [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] a [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] pontos de vida de um alvo aliado e mais [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] ao longo de 15 sec. Sua próxima Cura Encadeada lançada nesse alvo dentro de 15 sec consumirá o efeito de cura periódica e aumentará em 25% a quantidade de pontos de vida curados pela Cura Encadeada. Este feitiço também ativa Despertar Ancestral."},
[408524] = {name = "Proficiência em Escudo", additional_info = "[q]Cada vez que Bloquear, você regenera pontos de mana equivalentes a 8% do seu máximo de pontos de mana e ganha Armadura equivalente a 30% do valor de armadura do escudo, acumulando até 5 vezes. Você também ganha sempre 10% a mais de chance de Bloquear e 15% a mais no valor de Bloqueio.\n\n Além disso, a cada habilidade de Choque usada, você ganha 2 de dano mágico para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec."},
[408525] = {name = "Proficiência em Escudo", additional_info = "Instantâneo\n[q]Aumenta a armadura em 30% do valor de Armadura do escudo por 15 sec, acumulando até 5 vezes."},
[408531] = {name = "Caminho Telúrico", additional_info = "[q]Com a Arma Trinca-pedra ativa como arma da mão principal e um escudo equipado, a ameaça aumenta em 65%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque, mas tem o alcance reduzido à distância corpo a corpo. Entretanto, o alcance dos seus feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava é reduzido em 20 m."},
[408680] = {name = "Caminho Telúrico", additional_info = "Instantâneo\n[q]Com a Arma Trinca-pedra ativa como arma da mão principal, a ameaça aumenta em 65%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque."},
