[409433] = {name = "Tiro Quimérico", additional_info = "{6% de base mana} {Alcance de 8m}\n6 seg de recarga\nRequer Arma de Longo Alcance\n[q]Você causa 135% do dano da arma, renovando a Picada em seu alvo e ativando um efeito:\n\n Picada de Serpente – Causa instantaneamente 48% do dano causado pela Picada de Serpente.\n\n Picada de Víbora – Recupera instantaneamente o mana equivalente a 60% da quantidade total drenada pela sua Picada de Víbora.\n\n Picada de Escorpídeo – Tenta desarmar o alvo por 10 sec. Este efeito não pode ocorrer mais de uma vez a cada 1 minuto."},
