[409510] = {name = "Armadilha Congelante", additional_info = "{50 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de gelo em um local próximo que congela o primeiro inimigo que se aproximar, impedindo-o de realizar qualquer ação por 10 sec. Qualquer dano causado quebrará o gelo. A armadilha existirá por 1 min. Só pode haver uma armadilha ativa por vez."},
[409512] = {name = "Armadilha Congelante", additional_info = "{75 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de gelo em um local próximo que congela o primeiro inimigo que se aproximar, impedindo-o de realizar qualquer ação por 15 sec. Qualquer dano causado quebrará o gelo. A armadilha existirá por 1 min. Só pode haver uma armadilha ativa por vez."},
[409519] = {name = "Armadilha Congelante", additional_info = "{100 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de gelo em um local próximo que congela o primeiro inimigo que se aproximar, impedindo-o de realizar qualquer ação por 20 sec. Qualquer dano causado quebrará o gelo. A armadilha existirá por 1 min. Só pode haver uma armadilha ativa por vez."},
[409520] = {name = "Armadilha Gélida", additional_info = "60 de Mana\n{Instantâneo} {15 seg de recarga}\n[q]Posiciona uma armadilha gélida em um local próximo que cria uma camada de gelo no chão quando um inimigo se aproxima. O efeito dura 30 sec. Todos os inimigos em um raio de 10 m terão sua velocidade de movimento reduzida em 60% enquanto estiverem nessa área. A armadilha existirá por 1 min. Só pode haver uma armadilha ativa por vez."},
[409521] = {name = "Armadilha Imolante", additional_info = "{50 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que queimará o primeiro inimigo que se aproximar, causando 105 de dano de Fogo ao longo de 15 sec. A armadilha existirá por 1 min. Apenas uma armadilha pode estar ativa por vez."},
[409524] = {name = "Armadilha Imolante", additional_info = "{90 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que queimará o primeiro inimigo que se aproximar, causando 215 de dano de Fogo ao longo de 15 sec. A armadilha existirá por 1 min. Apenas uma armadilha pode estar ativa por vez."},
[409526] = {name = "Armadilha Imolante", additional_info = "{135 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que queimará o primeiro inimigo que se aproximar, causando 340 de dano de Fogo ao longo de 15 sec. A armadilha existirá por 1 min. Apenas uma armadilha pode estar ativa por vez."},
[409528] = {name = "Armadilha Imolante", additional_info = "{190 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que queimará o primeiro inimigo que se aproximar, causando 510 de dano de Fogo ao longo de 15 sec. A armadilha existirá por 1 min. Apenas uma armadilha pode estar ativa por vez."},
[409530] = {name = "Armadilha Imolante", additional_info = "{245 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que queimará o primeiro inimigo que se aproximar, causando 690 de dano de Fogo ao longo de 15 sec. A armadilha existirá por 1 min. Apenas uma armadilha pode estar ativa por vez."},
[409532] = {name = "Armadilha Explosiva", additional_info = "{275 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que explode quando um inimigo se aproxima, causando 104 to 135 de dano de Fogo. Também causa 150 de dano de Fogo ao longo de 20 sec a todos os inimigos em um raio de 10 m. As armadilhas duram 1 min. Só pode existir uma Armadilha ativa por vez."},
[409534] = {name = "Armadilha Explosiva", additional_info = "{395 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que explode quando um inimigo se aproxima, causando 145 to 193 de dano de Fogo. Também causa 240 de dano de Fogo ao longo de 20 sec a todos os inimigos em um raio de 10 m. As armadilhas duram 1 min. Só pode existir uma Armadilha ativa por vez."},
[409535] = {name = "Armadilha Explosiva", additional_info = "{520 de Mana} {Alcance de 35m}\n15 seg de recarga\n[q]Coloca uma armadilha de fogo em um local próximo que explode quando um inimigo se aproxima, causando 208 to 265 de dano de Fogo. Também causa 330 de dano de Fogo ao longo de 20 sec a todos os inimigos em um raio de 10 m. As armadilhas duram 1 min. Só pode existir uma Armadilha ativa por vez."},
[409541] = {name = "Lançador de Armadilhas", additional_info = "[q]Agora é possível colocar suas Armadilhas Explosivas, Congelantes e Imolantes em qualquer lugar em um raio de 35 m. Além disso, suas armadilhas baseadas em Fogo e em Gelo agora têm recargas compartilhadas separadas."},
[409552] = {name = "Tiro Explosivo", additional_info = "{3.5% de base mana} {Alcance de 8m}\n6 seg de recarga\nRequer Arma de Longo Alcance\n[q]Você dispara uma carga explosiva que se aloja em um inimigo, causando [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] de dano de Fogo a todos os inimigos em um raio de 8 m. Além disso, a carga causará dano novamente, a cada segundo, por mais 2 sec."},
[409554] = {name = "Tiro Explosivo", additional_info = "Alcance ilimitado\n[q]Você dispara uma carga explosiva que se aloja em um inimigo, causando (Ranged attack power * 0.14 + 10)-(Ranged attack power * 0.14 + 10) de dano de Fogo. A carga causará dano ao alvo a cada segundo por mais until cancelled. Recarga compartilhada com Tiro Arcano."},
[409580] = {name = "Coração de Leão", additional_info = "8% de base mana\nInstantâneo\n[q]O Caçador invoca o coração do leão, aumentando em 10% o total de atributos e em 200 o Poder de Ataque de todos os aliados próximos e aumentando em 10% o total de atributos do Caçador."},
[409583] = {name = "Coração de Leão", additional_info = "Alcance de 100m\nInstantâneo\n[q]O Caçador invoca o coração do leão, aumentando em 10% o total de atributos de todos os aliados próximos e aumentando em 10% o total de atributos do Caçador."},
[409593] = {name = "Tiro Mortal", additional_info = "{3% de base mana} {Alcance de 35m}\n15 seg de recarga\nRequer Arma de Longo Alcance\n[q]Você tenta executar o alvo ferido com um ataque de longo alcance que causa 100% do dano da arma mais [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]. Tiro Mortal não tem alcance mínimo e recarrega se for usado em um inimigo com 20% ou menos do total de pontos de vida."},
[409687] = {name = "Especialização em Duas Armas", additional_info = "[q]Aumenta em 50% o dano causado pela arma secundária e faz o Golpe do Raptor atacar com ambas as armas enquanto você estiver empunhando duas armas."},
[409691] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 2 to 3 o dano corpo a corpo."},
[409693] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 5 o dano corpo a corpo."},
[409748] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 10 to 11 o dano corpo a corpo."},
[409750] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 17 o dano corpo a corpo."},
[409751] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 25 o dano corpo a corpo."},
[409752] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 40 o dano corpo a corpo."},
[409754] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 55 o dano corpo a corpo."},
[409755] = {name = "Golpe do Raptor", additional_info = "Alcance corpo a corpo\nInstantâneo\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 70 o dano corpo a corpo."},
[409805] = {name = "Golpes Selvagens", additional_info = "[q]Concede a habilidade Golpe Selvagem:\n\n\nEnquanto você estiver em Forma de Felino, Forma de Urso ou Forma de Urso Hediondo, integrantes do grupo ou raide em um raio de 100 m obtêm mais ferocidade de combate. Cada ataque corpo a corpo tem 20% de chance de conceder outro ataque com 20% a mais de Poder de Ataque. Sem efeito se o alvo já se beneficiar do Totem de Fúria dos Ventos."},
[409809] = {name = "Instintos de Sobrevivência", additional_info = "[q]Concede a habilidade Instintos de Sobrevivência:\n\n\nApós a ativação, concede 30% do seu máximo de pontos de vida e aumenta em 20% toda a cura não Física que você realiza por 20 sec. Quando o efeito expira, os pontos de vida são perdidos. É possível usar em qualquer forma.\n\n Além disso, você regenera 5 de Raiva a cada esquiva na Forma de Urso ou Urso Hediondo, 10 de energia na Forma de Felino ou 1% do seu máximo de pontos de mana em qualquer outra forma."},
[409810] = {name = "Crescimento Silvestre", additional_info = "[q]Concede a habilidade Crescimento Silvestre:\n\n\nCura [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de todos os integrantes do grupo do jogador selecionado em um raio de 43.5 m do alvo ao longo de 7 sec. A quantidade curada é aplicada rapidamente no início e fica mais lenta conforme o Crescimento Silvestre chega ao fim da duração."},
[409813] = {name = "Eclipse", additional_info = "[q]Concede a habilidade Eclipse:\n\n\nFogo Estelar aumenta em 30% a chance de acerto crítico das duas próximas duas Iras, e Ira reduz em 1.0 s o tempo de lançamento do seu próximo Fogo Estelar. Os dois efeitos acumulam até 4 cargas. Os dois feitiços também concedem 70% de chance em todas as situações de não perder tempo de lançamento quando receber dano."},
[409819] = {name = "Rugido Selvagem", additional_info = "[q]Concede a habilidade Rugido Selvagem:\n\n\nGolpe de finalização que aumenta em 30% o dano físico causado na Forma de Felino. Dura mais a cada ponto de combo.\n 1 ponto: 14 segundos\n 2 pontos: 19 segundos\n 3 pontos: 24 segundos\n 4 pontos: 29 segundos\n 5 pontos: 34 segundos"},
[409824] = {name = "Brotar da Vida", additional_info = "[q]Reduz em 0.5 s a recarga global das suas habilidades Rejuvenescer e Brotar da Vida, e você ganha a habilidade Brotar da Vida:\n\n\nCura [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida do alvo ao longo de 7 sec. Quando Brotar da Vida expira ou é dissipado, o alvo recebe instantaneamente uma cura de [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida, e o Druida recupera metade do custo do feitiço. Esse efeito pode acumular até 3 vezes no mesmo alvo."},
[409826] = {name = "Fúria da Natureza", additional_info = "[q]Concede a habilidade Fúria da Natureza:\n\n\nAumenta o poder de cura em 90% do dano mágico de Natureza por 30 sec."},
[409828] = {name = "Destroçar", additional_info = "[q]Concede a habilidade Destroçar (Urso) e substitui a habilidade Garra por Destroçar (Felino). Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa.\n\n\nDestroça o alvo, causando 160% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa.\n\n Acertar um alvo com Despedaçar (Urso) também concede 4 de Poder de Ataque para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec.\n\n\nDestroça o alvo, causando 270% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Concede 1 ponto de combo. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa."},
[409830] = {name = "Nutrir", additional_info = "[q]Concede a habilidade Nutrir:\n\n\nCura [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] a [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de um alvo aliado. Cura mais 20% se você tiver um efeito de Rejuvenescer, Recrescimento, Brotar da Vida ou Crescimento Silvestre ativo no alvo. Este feitiço se beneficia de todos os efeitos associados ao Toque de Cura ou Recrescimento e os ativa."},
[409831] = {name = "Estado Onírico", additional_info = "[q]Concede a habilidade Estado Onírico:\n\n\nOs acertos críticos de feitiços não periódicos que causam dano ou qualquer dano de Surto Estelar concedem 50% da sua regeneração de mana enquanto estiver lançando feitiços por 8 sec e aumenta em 20% os danos de Natureza e Arcano causados ao alvo por 12 sec."},
[409832] = {name = "Fúria de Tempesfúria", additional_info = "[q]Concede a habilidade Fúria de Tempesfúria:\n\n\nReduz em 100% o custo de mana de Ira e a cada vez que você causa dano com Ira, você tem 12% de chance de fazer o próximo lançamento de Toque de Cura dentro de 15 sec ser instantâneo e poder ser lançado de qualquer forma metamorfoseada. Permite lançar Ira enquanto você estiver sob a forma de Árvore da Vida."},
[409856] = {name = "Ritual do Espírito", additional_info = "Alcance de 30m\nCanalizado (10 min de lançamento)\n[q]Inicia um ritual para libertar o espírito de um aventureiro morto."},
[409858] = {name = "Dummy Trigger", additional_info = nil},
[409906] = {name = "Foco de Luz", additional_info = "[q]Concede a habilidade Foco de Luz:\n\n\nO alvo se torna um Foco de Luz para todos os integrantes do raide ou grupo num raio de 40 m. Qualquer cura que você lançar nos integrantes do raide ou grupo também cura o Foco em 75% do total curado. Somente um alvo pode ser o Foco de Luz por vez. Dura 1 hour."},
[409911] = {name = "Mão da Desforra", additional_info = "[q]Concede a habilidade Mão da Desforra:\n\n\nProvoca o alvo a atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Enquanto você souber esta habilidade, o bônus de ameaça de Fúria Íntegra é aumentado em 80% e faz você ganhar mana equivalente a 25% do total curado. Além disso, enquanto a Fúria Íntegra está ativa, dano que deixe você com menos de 35% dos pontos de vida é reduzido em 20%. Fúria Íntegra permanece ativa até ser cancelada."},
[409914] = {name = "Golpe do Cruzado", additional_info = "[q]Concede a habilidade Golpe do Cruzado:\n\n\nUm golpe instantâneo que causa dano Sagrado equivalente a 75% do dano da arma e regenera 5% do seu máximo de pontos de mana. A duração de todos os efeitos de Julgamento no alvo é renovada a cada 30 s."},
[409918] = {name = "Inspiração (Julgamento)", additional_info = nil},
[409920] = {name = "Aprender Relíquia (Julgamento)", additional_info = nil},
[409922] = {name = "Martelo do Íntegro", additional_info = "[q]Concede a habilidade Martelo do Íntegro:\n\n\nMartela o alvo atual e até 2 alvos próximos adicionais, causando dano Sagrado equivalente a 3 vezes do seu dano com a mão principal por segundo."},
[409924] = {name = "Tempestade Divina", additional_info = "[q]Concede a habilidade Tempestade Divina:\n\n\nUm ataque de arma instantâneo que causa 110% do dano da arma a até 4 inimigos em um raio de 8 m. A Tempestade Divina cura até 3 integrantes do grupo ou raide, totalizando 25% do dano causado."},
[409925] = {name = "Luz Divina", additional_info = "[q]Concede a habilidade Luz Divina:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 355 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 393 / 100] pontos de vida de um alvo aliado. 50% de qualquer cura sobressalente recebida pelo alvo é convertida em um escudo de absorção que dura 15 sec. Vários lançamentos de Luz Divina não acumulam este escudo.\n\n Luz Divina se beneficia de todos os talentos e efeitos que Luz Sagrada ativa ou modifica."},
[409930] = {name = "Incunábulo do Julgamento", additional_info = nil},
[409932] = {name = "Proficiência em Auras", additional_info = "[q]Concede a habilidade Proficiência em Auras:\n\n\nFaz sua Aura de Concentração deixar todos os alvos afetados imunes a efeitos de silêncio e interrupção, aumentando em 100% o efeito de todas as outras auras. Dura 6 sec."},
[409933] = {name = "Escudo do Vingador", additional_info = "[q]Concede a habilidade Escudo do Vingador:\n\n\nAtira um escudo sagrado contra o inimigo, causando [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] a [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] de dano Sagrado e estonteando-o para, então, pular para os inimigos próximos. Afeta um total de 3 alvos. Dura 5 sec."},
[409934] = {name = "Ira Vingativa", additional_info = "[q]Concede a habilidade Ira Vingativa:\n\n\nAumenta em 20% todo dano causado e cura realizada por 20 sec. Causa Abstinência e não é possível usar com a Abstinência ativa."},
[409935] = {name = "Mão do Sacrifício", additional_info = "[q]Ganha a habilidade Mão do Sacrifício:\n\n\nFaz com que um integrante do grupo ou raide transfira 30% do dano recebido para o lançador. Dura 12 sec ou até que o lançador tenha transferido 100% do seu máximo de pontos de vida."},
[409936] = {name = "Modelo de Inspiração", additional_info = "[q]Concede a habilidade\n Modelo de Inspiração:\n\n\nSua presença inspiradora dissipa periodicamente efeitos de Medo e Sono em integrantes do grupo próximos."},
[409938] = {name = "Nova de Fogo", additional_info = "[q]Concede a habilidade Nova de Fogo, substituindo o Totem de Nova de Fogo:\n\n\nO feitiço Totem de Nova de Fogo é substituído pela Nova de Fogo, o que faz o atual totem de Fogo emitir dano de onde estiver."},
[409940] = {name = "Especialização em Duas Armas", additional_info = "[q]Concede a habilidade Especialização em Duas Armas:\n\n\nAumenta em 5% a chance de acertar com ataques corpo a corpo e feitiços enquanto estiver empunhando duas armas, a habilidade Ataque da Tempestade agora acerta com ambas as armas e aumenta em 50% o dano causado pela sua arma secundária."},
[409941] = {name = "Escudo de Água", additional_info = "[q]Concede a habilidade Escudo de Água:\n\n\nO lançador é cercado por 3 globos de água que lhe concedem 1% do máximo de pontos de mana a cada 5 s. Quando um feitiço, ataque corpo a corpo ou de longo alcance atinge o lançador, 4% do máximo de pontos de mana do lançador são restaurados. Isso gasta um globo de água. Um globo é ativado em intervalos de segundos. Dura 10 min. Apenas um Escudo Elemental pode estar ativo no Xamã por vez."},
[409943] = {name = "Proficiência em Escudo", additional_info = "[q]Concede a habilidade Proficiência em Escudo:\n\n\nCada vez que Bloquear, você regenera pontos de mana equivalentes a 8% do seu máximo de pontos de mana e ganha Armadura equivalente a 30% do valor de armadura do escudo, acumulando até 5 vezes. Você também ganha sempre 10% a mais de chance de Bloquear e 15% a mais no valor de Bloqueio.\n\n Além disso, a cada habilidade de Choque usada, você ganha 2 de dano mágico para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec."},
[409944] = {name = "Conselho dos Ancestrais", additional_info = "[q]Concede a habilidade Conselho dos Ancestrais:\n\n\nPelos próximos 10 sec, 25% do seu dano serão convertidos em cura de até 3 integrantes do grupo próximos, e 100% da cura serão convertidos em dano no último alvo de Choque Flamejante."},
[409945] = {name = "Sobrecarga", additional_info = "[q]Concede a habilidade Sobrecarga:\n\n\nConcede aos feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava 60% de chance de serem lançados novamente no mesmo alvo. Esse segundo feitiço não tem custo, causa metade do dano ou cura e não gera ameaça."},
[409946] = {name = "Arma da Voragem", additional_info = "[q]Concede a habilidade Arma da Voragem:\n\n\nQuando causar dano com um ataque corpo a corpo, você terá chance de reduzir em 20% o tempo de lançamento e o custo de mana do seu próximo feitiço Raio, Cadeia de Raios, Onda Curativa Menor ou Estouro de Lava. Chance aumentada em 50% quando a arma da mão principal está encantada com Arma de Fúria dos Ventos, e em mais 50% com uma arma de duas mãos. Acumula até 5 vezes. Dura 30 sec."},
[409947] = {name = "Escudo da Terra", additional_info = "[q]Concede a habilidade Escudo da Terra:\n\n\nProtege o alvo aliado com um escudo terreno, reduzindo em 30% o tempo de lançamento ou canalização perdido quando você recebe dano e fazendo com que os ataques recuperem [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] pontos de vida do alvo protegido. Este efeito só pode ocorrer uma vez a cada alguns segundos. 9 cargas. 10 min de duração. Escudo da Terra só pode ser colocado em um alvo de cada vez."},
[409951] = {name = "Espírito do Alfa", additional_info = "[q]Concede a habilidade Espírito do Alfa:\n\n\nImbui o alvo com o espírito de um lobo alfa, aumentando em 45% toda a ameaça gerada pelo alvo por 30 min. Limite de 1 alvo. Se o lançamento for em um alvo que não seja si mesmo, o Xamã também ganha Beta Leal, aumentando em 5% o dano Físico causado e reduzindo em 30% toda a ameaça gerada por 30 min. O mesmo alvo não pode ter Espírito do Alfa e Beta Leal ao mesmo tempo."},
[409952] = {name = "Estouro de Lava", additional_info = "[q]Concede a habilidade Estouro de Lava:\n\n\nVocê lança lava derretida contra o alvo, causando [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] a [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] de dano de Fogo. Se o alvo estiver sob o efeito de seu Choque Flamejante, o Estouro de Lava causará um acerto crítico."},
[409953] = {name = "Açoite de Lava", additional_info = "[q]Concede a habilidade Açoite de Lava:\n\n\nVocê imbui a sua arma de mão secundária em lava, causando instantaneamente 100% do dano da arma de mão secundária. O dano aumenta em 125% se sua arma de mão secundária estiver encantada com Labareda."},
[409954] = {name = "Contracorrente", additional_info = "[q]Concede a habilidade Contracorrente:\n\n\nCura [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] a [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] pontos de vida de um alvo aliado e mais [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] ao longo de 15 sec. Sua próxima Cura Encadeada lançada nesse alvo dentro de 15 sec consumirá o efeito de cura periódica e aumentará em 25% a quantidade de pontos de vida curados pela Cura Encadeada. Este feitiço também ativa Despertar Ancestral."},
[409955] = {name = "Caminho Telúrico", additional_info = "[q]Concede a habilidade Caminho Telúrico:\n\n\nCom a Arma Trinca-pedra ativa como arma da mão principal e um escudo equipado, a ameaça aumenta em 65%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque, mas tem o alcance reduzido à distância corpo a corpo. Entretanto, o alcance dos seus feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava é reduzido em 20 m."},
[409957] = {name = "Tiro Firme", additional_info = "[q]Concede a habilidade Tiro Firme:\n\n\nUm tiro firme que causa 100% do dano da arma de longo alcance."},
[409958] = {name = "Mestre Atirador Perito", additional_info = "[q]Concede a habilidade Mestre Atirador Perito:\n\n\nAumenta em 5% sua chance de acerto crítico e reduz em 25% o custo de Mana de todas as suas habilidades de Tiro."},
[409959] = {name = "Expor Fraqueza", additional_info = "[q]Concede a habilidade Expor Fraqueza:\n\n\nSeus acertos críticos corpo a corpo e de longo alcance aumentam o poder de ataque em 40% da sua Agilidade atual por 7 sec."},
[409960] = {name = "Exterminador de Najas", additional_info = "[q]Concede a habilidade Exterminador de Najas:\n\n\nMordida de Mangusto agora tem 10% de chance de se ativar com cada um dos seus ataques corpo a corpo e 100% de chance quando um inimigo se esquiva. Essa chance acumula, aumentando em 10% a cada ataque subsequente se não for reiniciada. Mordida de Mangusto também causa dano adicional equivalente a 45% do seu Poder de Ataque."},
[409961] = {name = "Especialização em Duas Armas", additional_info = "[q]Concede a habilidade Empunhar Duas Armas:\n\n\nAumenta em 50% o dano causado pela arma secundária e faz o Golpe do Raptor atacar com ambas as armas enquanto você estiver empunhando duas armas."},
[409962] = {name = "Domínio das Feras", additional_info = "[q]Concede a habilidade Domínio das Feras:\n\n\nAumenta em 10% o dano e os pontos de vida do ajudante, e em 50% a regeneração de Concentração. Além disso, o Rosnar do ajudante agora também Provoca o alvo a atacá-lo por 3 sec."},
[409963] = {name = "Evocar Espírito", additional_info = nil},
[409968] = {name = "Lançador de Armadilhas", additional_info = "[q]Concede a habilidade Lançador de Armadilhas:\n\n\nAgora é possível colocar suas Armadilhas Explosivas, Congelantes e Imolantes em qualquer lugar em um raio de 35 m. Além disso, suas armadilhas baseadas em Fogo e em Gelo agora têm recargas compartilhadas separadas."},
[409974] = {name = "Tiro Mortal", additional_info = "[q]Concede a habilidade Tiro Mortal:\n\n\nVocê tenta executar o alvo ferido com um ataque de longo alcance que causa 100% do dano da arma mais [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]. Tiro Mortal não tem alcance mínimo e recarrega se for usado em um inimigo com 20% ou menos do total de pontos de vida."},
[409976] = {name = "Tiro Quimérico", additional_info = "[q]Concede a habilidade Tiro Quimérico:\n\n\nVocê causa 135% do dano da arma, renovando a Picada em seu alvo e ativando um efeito:\n\n Picada de Serpente – Causa instantaneamente 48% do dano causado pela Picada de Serpente.\n\n Picada de Víbora – Recupera instantaneamente o mana equivalente a 60% da quantidade total drenada pela sua Picada de Víbora.\n\n Picada de Escorpídeo – Tenta desarmar o alvo por 10 sec. Este efeito não pode ocorrer mais de uma vez a cada 1 minuto."},
[409978] = {name = "Tiro Explosivo", additional_info = "[q]Concede a habilidade Tiro Explosivo:\n\n\nVocê dispara uma carga explosiva que se aloja em um inimigo, causando [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] de dano de Fogo a todos os inimigos em um raio de 8 m. Além disso, a carga causará dano novamente, a cada segundo, por mais 2 sec."},
[409979] = {name = "Lobo Solitário", additional_info = "[q]Concede a habilidade Lobo Solitário:\n\n\nVocê causa 30% a mais de dano com todos os ataques quando não tiver um ajudante ativo."},
[409988] = {name = "Forçar Lançamento Atrasado de Banir de Jogador", additional_info = nil},
[409999] = {name = "Gravar Luvas - Foco de Luz", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Foco de Luz:\n\n\nO alvo se torna um Foco de Luz para todos os integrantes do raide ou grupo num raio de 40 m. Qualquer cura que você lançar nos integrantes do raide ou grupo também cura o Foco em 75% do total curado. Somente um alvo pode ser o Foco de Luz por vez. Dura 1 hour."},
[410001] = {name = "Gravar Luvas - Mão da Desforra", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Mão da Desforra:\n\n\nProvoca o alvo a atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Enquanto você souber esta habilidade, o bônus de ameaça de Fúria Íntegra é aumentado em 80% e faz você ganhar mana equivalente a 25% do total curado. Além disso, enquanto a Fúria Íntegra está ativa, dano que deixe você com menos de 35% dos pontos de vida é reduzido em 20%. Fúria Íntegra permanece ativa até ser cancelada."},
[410002] = {name = "Gravar Luvas - Golpe do Cruzado", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Golpe do Cruzado:\n\n\nUm golpe instantâneo que causa dano Sagrado equivalente a 75% do dano da arma e regenera 5% do seu máximo de pontos de mana. A duração de todos os efeitos de Julgamento no alvo é renovada a cada 30 s."},
[410005] = {name = "Gravar Calça - Proficiência em Auras", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Proficiência em Auras:\n\n\nFaz sua Aura de Concentração deixar todos os alvos afetados imunes a efeitos de silêncio e interrupção, aumentando em 100% o efeito de todas as outras auras. Dura 6 sec."},
[410008] = {name = "Gravar Calça - Escudo do Vingador", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Escudo do Vingador:\n\n\nAtira um escudo sagrado contra o inimigo, causando [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] a [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] de dano Sagrado e estonteando-o para, então, pular para os inimigos próximos. Afeta um total de 3 alvos. Dura 5 sec."},
[410010] = {name = "Gravar Calça - Mão do Sacrifício", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa da Mão do Sacrifício:\n\n\nFaz com que um integrante do grupo ou raide transfira 30% do dano recebido para o lançador. Dura 12 sec ou até que o lançador tenha transferido 100% do seu máximo de pontos de vida."},
[410011] = {name = "Gravar Calça - Modelo de Inspiração", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Modelo de Inspiração:\n\n\nSua presença inspiradora dissipa periodicamente efeitos de Medo e Sono em integrantes do grupo próximos."},
[410013] = {name = "Gravar Braçadeiras - Martelo do Íntegro", additional_info = "3 seg de lançamento\nRequer Braçadeiras\n[q]Grava nas braçadeiras a runa de Martelo do Íntegro:\n\n\nMartela o alvo atual e até 2 alvos próximos adicionais, causando dano Sagrado equivalente a 3 vezes do seu dano com a mão principal por segundo."},
[410014] = {name = "Gravar Peitoral - Tempestade Divina", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava no peitoral a runa de Tempestade Divina:\n\n\nUm ataque de arma instantâneo que causa 110% do dano da arma a até 4 inimigos em um raio de 8 m. A Tempestade Divina cura até 3 integrantes do grupo ou raide, totalizando 25% do dano causado."},
[410015] = {name = "Gravar Manto - Luz Divina", additional_info = "3 seg de lançamento\nRequer Manto\n[q]Grava no manto a runa de Luz Divina:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 355 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 393 / 100] pontos de vida de um alvo aliado. 50% de qualquer cura sobressalente recebida pelo alvo é convertida em um escudo de absorção que dura 15 sec. Vários lançamentos de Luz Divina não acumulam este escudo.\n\n Luz Divina se beneficia de todos os talentos e efeitos que Luz Sagrada ativa ou modifica."},
[410021] = {name = "Gravar Peitoral - Golpe Selvagem", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Golpe Selvagem:\n\n\nEnquanto você estiver em Forma de Felino, Forma de Urso ou Forma de Urso Hediondo, integrantes do grupo ou raide em um raio de 100 m obtêm mais ferocidade de combate. Cada ataque corpo a corpo tem 20% de chance de conceder outro ataque com 20% a mais de Poder de Ataque. Sem efeito se o alvo já se beneficiar do Totem de Fúria dos Ventos."},
[410023] = {name = "Gravar Calça - Rugido Selvagem", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Rugido Selvagem:\n\n\nGolpe de finalização que aumenta em 30% o dano físico causado na Forma de Felino. Dura mais a cada ponto de combo.\n 1 ponto: 14 segundos\n 2 pontos: 19 segundos\n 3 pontos: 24 segundos\n 4 pontos: 29 segundos\n 5 pontos: 34 segundos"},
[410025] = {name = "Gravar Luvas - Destroçar", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Destroçar:\n\n\nDestroça o alvo, causando 160% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa.\n\n Acertar um alvo com Despedaçar (Urso) também concede 4 de Poder de Ataque para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec."},
[410027] = {name = "Gravar Botas - Instintos de Sobrevivência", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Instintos de Sobrevivência:\n\n\nApós a ativação, concede 30% do seu máximo de pontos de vida e aumenta em 20% toda a cura não Física que você realiza por 20 sec. Quando o efeito expira, os pontos de vida são perdidos. É possível usar em qualquer forma.\n\n Além disso, você regenera 5 de Raiva a cada esquiva na Forma de Urso ou Urso Hediondo, 10 de energia na Forma de Felino ou 1% do seu máximo de pontos de mana em qualquer outra forma."},
[410028] = {name = "Gravar Luvas - Crescimento Silvestre", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Crescimento Silvestre:\n\n\nCura [17 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de todos os integrantes do grupo do jogador selecionado em um raio de 43.5 m do alvo ao longo de 7 sec. A quantidade curada é aplicada rapidamente no início e fica mais lenta conforme o Crescimento Silvestre chega ao fim da duração."},
[410029] = {name = "Gravar Cinto - Eclipse", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Eclipse:\n\n\nFogo Estelar aumenta em 30% a chance de acerto crítico das duas próximas duas Iras, e Ira reduz em 1.0 s o tempo de lançamento do seu próximo Fogo Estelar. Os dois efeitos acumulam até 4 cargas. Os dois feitiços também concedem 70% de chance em todas as situações de não perder tempo de lançamento quando receber dano."},
[410033] = {name = "Gravar Calça - Brotar da Vida", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Brotar da Vida:\n\nReduz em 0.5 s a recarga global das suas habilidades Rejuvenescer e Brotar da Vida, e você ganha a habilidade Brotar da Vida:\n\n\nCura [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida do alvo ao longo de 7 sec. Quando Brotar da Vida expira ou é dissipado, o alvo recebe instantaneamente uma cura de [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida, e o Druida recupera metade do custo do feitiço. Esse efeito pode acumular até 3 vezes no mesmo alvo."},
[410059] = {name = "Gravar Cinto - Nutrir", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Nutrir:\n\n\nCura [161 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] a [189 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de um alvo aliado. Cura mais 20% se você tiver um efeito de Rejuvenescer, Recrescimento, Brotar da Vida ou Crescimento Silvestre ativo no alvo. Este feitiço se beneficia de todos os efeitos associados ao Toque de Cura ou Recrescimento e os ativa."},
[410060] = {name = "Gravar Botas - Estado Onírico", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Estado Onírico:\n\n\nOs acertos críticos de feitiços não periódicos que causam dano ou qualquer dano de Surto Estelar concedem 50% da sua regeneração de mana enquanto estiver lançando feitiços por 8 sec e aumenta em 20% os danos de Natureza e Arcano causados ao alvo por 12 sec."},
[410061] = {name = "Gravar Peitoral - Fúria de Tempesfúria", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Fúria de Tempesfúria:\n\n\nReduz em 100% o custo de mana de Ira e a cada vez que você causa dano com Ira, você tem 12% de chance de fazer o próximo lançamento de Toque de Cura dentro de 15 sec ser instantâneo e poder ser lançado de qualquer forma metamorfoseada. Permite lançar Ira enquanto você estiver sob a forma de Árvore da Vida."},
[410093] = {name = "Gravar Cinto - Nova de Fogo", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Nova de Fogo:\n\n\nO feitiço Totem de Nova de Fogo é substituído pela Nova de Fogo, o que faz o atual totem de Fogo emitir dano de onde estiver."},
[410094] = {name = "Gravar Peitoral - Sobrecarga", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Sobrecarga:\n\n\nConcede aos feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava 60% de chance de serem lançados novamente no mesmo alvo. Esse segundo feitiço não tem custo, causa metade do dano ou cura e não gera ameaça."},
[410095] = {name = "Gravar Luvas - Estouro de Lava", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Estouro de Lava:\n\n\nVocê lança lava derretida contra o alvo, causando [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] a [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] de dano de Fogo. Se o alvo estiver sob o efeito de seu Choque Flamejante, o Estouro de Lava causará um acerto crítico."},
[410096] = {name = "Gravar Peitoral - Especialização em Duas Armas", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Especialização em Duas Armas:\n\n\nAumenta em 5% a chance de acertar com ataques corpo a corpo e feitiços enquanto estiver empunhando duas armas, a habilidade Ataque da Tempestade agora acerta com ambas as armas e aumenta em 50% o dano causado pela sua arma secundária."},
[410097] = {name = "Gravar Luvas - Escudo de Água", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Escudo de Água:\n\n\nO lançador é cercado por 3 globos de água que lhe concedem 1% do máximo de pontos de mana a cada 5 s. Quando um feitiço, ataque corpo a corpo ou de longo alcance atinge o lançador, 4% do máximo de pontos de mana do lançador são restaurados. Isso gasta um globo de água. Um globo é ativado em intervalos de segundos. Dura 10 min. Apenas um Escudo Elemental pode estar ativo no Xamã por vez."},
[410098] = {name = "Gravar Peitoral - Proficiência em Escudo", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Proficiência em Escudo:\n\n\nCada vez que Bloquear, você regenera pontos de mana equivalentes a 8% do seu máximo de pontos de mana e ganha Armadura equivalente a 30% do valor de armadura do escudo, acumulando até 5 vezes. Você também ganha sempre 10% a mais de chance de Bloquear e 15% a mais no valor de Bloqueio.\n\n Além disso, a cada habilidade de Choque usada, você ganha 2 de dano mágico para cada ponto da sua habilidade de defesa acima de ( 60 * 5). Dura 15 sec."},
[410099] = {name = "Gravar Calça - Conselho dos Ancestrais", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Conselho dos Ancestrais:\n\n\nPelos próximos 10 sec, 25% do seu dano serão convertidos em cura de até 3 integrantes do grupo próximos, e 100% da cura serão convertidos em dano no último alvo de Choque Flamejante."},
[410100] = {name = "Gravar Cinto - Arma da Voragem", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Arma da Voragem:\n\n\nQuando causar dano com um ataque corpo a corpo, você terá chance de reduzir em 20% o tempo de lançamento e o custo de mana do seu próximo feitiço Raio, Cadeia de Raios, Onda Curativa Menor ou Estouro de Lava. Chance aumentada em 50% quando a arma da mão principal está encantada com Arma de Fúria dos Ventos, e em mais 50% com uma arma de duas mãos. Acumula até 5 vezes. Dura 30 sec."},
[410101] = {name = "Gravar Calça - Escudo da Terra", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava nas calças a runa de Escudo da Terra:\n\n\nProtege o alvo aliado com um escudo terreno, reduzindo em 30% o tempo de lançamento ou canalização perdido quando você recebe dano e fazendo com que os ataques recuperem [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] pontos de vida do alvo protegido. Este efeito só pode ocorrer uma vez a cada alguns segundos. 9 cargas. 10 min de duração. Escudo da Terra só pode ser colocado em um alvo de cada vez."},
[410103] = {name = "Gravar Botas - Espírito do Alfa", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Espírito do Alfa:\n\n\nImbui o alvo com o espírito de um lobo alfa, aumentando em 45% toda a ameaça gerada pelo alvo por 30 min. Limite de 1 alvo. Se o lançamento for em um alvo que não seja si mesmo, o Xamã também ganha Beta Leal, aumentando em 5% o dano Físico causado e reduzindo em 30% toda a ameaça gerada por 30 min. O mesmo alvo não pode ter Espírito do Alfa e Beta Leal ao mesmo tempo."},
[410104] = {name = "Gravar Luvas - Açoite de Lava", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Açoite de Lava:\n\n\nVocê imbui a sua arma de mão secundária em lava, causando instantaneamente 100% do dano da arma de mão secundária. O dano aumenta em 125% se sua arma de mão secundária estiver encantada com Labareda."},
[410105] = {name = "Gravar Braçadeiras - Contracorrente", additional_info = "3 seg de lançamento\nRequer Braçadeiras\n[q]Grava nas braçadeiras a runa de\n Contracorrente:\n\n\nCura [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] a [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] pontos de vida de um alvo aliado e mais [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] ao longo de 15 sec. Sua próxima Cura Encadeada lançada nesse alvo dentro de 15 sec consumirá o efeito de cura periódica e aumentará em 25% a quantidade de pontos de vida curados pela Cura Encadeada. Este feitiço também ativa Despertar Ancestral."},
[410107] = {name = "Gravar Calça - Caminho Telúrico", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Caminho Telúrico:\n\n\nCom a Arma Trinca-pedra ativa como arma da mão principal e um escudo equipado, a ameaça aumenta em 65%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque, mas tem o alcance reduzido à distância corpo a corpo. Entretanto, o alcance dos seus feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava é reduzido em 20 m."},
[410109] = {name = "Gravar Cinto - Tiro Firme", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Tiro Firme:\n\n\nUm tiro firme que causa 100% do dano da arma de longo alcance."},
[410110] = {name = "Gravar Peitoral - Domínio das Feras", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Domínio das Feras:\n\n\nAumenta em 10% o dano e os pontos de vida do ajudante, e em 50% a regeneração de Concentração. Além disso, o Rosnar do ajudante agora também Provoca o alvo a atacá-lo por 3 sec."},
[410111] = {name = "Gravar Calça - Tiro Mortal", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Tiro Mortal:\n\n\nVocê tenta executar o alvo ferido com um ataque de longo alcance que causa 100% do dano da arma mais [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]. Tiro Mortal não tem alcance mínimo e recarrega se for usado em um inimigo com 20% ou menos do total de pontos de vida."},
[410113] = {name = "Gravar Peitoral - Mestre Atirador Perito", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Mestre Atirador Perito:\n\n\nAumenta em 5% sua chance de acerto crítico e reduz em 25% o custo de Mana de todas as suas habilidades de Tiro."},
[410114] = {name = "Gravar Cinto - Expor Fraqueza", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Expor Fraqueza:\n\n\nSeus acertos críticos corpo a corpo e de longo alcance aumentam o poder de ataque em 40% da sua Agilidade atual por 7 sec."},
[410115] = {name = "Exterminador de Najas", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Exterminador de Najas:\n\n\nMordida de Mangusto agora tem 10% de chance de se ativar com cada um dos seus ataques corpo a corpo e 100% de chance quando um inimigo se esquiva. Essa chance acumula, aumentando em 10% a cada ataque subsequente se não for reiniciada. Mordida de Mangusto também causa dano adicional equivalente a 45% do seu Poder de Ataque."},
[410116] = {name = "Gravar Botas - Especialização em Duas Armas", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Especialização em Duas Armas:\n\n\nAumenta em 50% o dano causado pela arma secundária e faz o Golpe do Raptor atacar com ambas as armas enquanto você estiver empunhando duas armas."},
[410118] = {name = "Gravar Botas - Lançador de Armadilhas", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Lançador de Armadilhas:\n\n\nAgora é possível colocar suas Armadilhas Explosivas, Congelantes e Imolantes em qualquer lugar em um raio de 35 m. Além disso, suas armadilhas baseadas em Fogo e em Gelo agora têm recargas compartilhadas separadas."},
[410121] = {name = "Gravar Luvas - Tiro Quimérico", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Tiro Quimérico:\n\n\nVocê causa 135% do dano da arma, renovando a Picada em seu alvo e ativando um efeito:\n\n Picada de Serpente – Causa instantaneamente 48% do dano causado pela Picada de Serpente.\n\n Picada de Víbora – Recupera instantaneamente o mana equivalente a 60% da quantidade total drenada pela sua Picada de Víbora.\n\n Picada de Escorpídeo – Tenta desarmar o alvo por 10 sec. Este efeito não pode ocorrer mais de uma vez a cada 1 minuto."},
[410122] = {name = "Gravar Peitoral - Lobo Solitário", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Lobo Solitário:\n\n\nVocê causa 30% a mais de dano com todos os ataques quando não tiver um ajudante ativo."},
[410123] = {name = "Gravar Luvas - Tiro Explosivo", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Tiro Explosivo:\n\n\nVocê dispara uma carga explosiva que se aloja em um inimigo, causando [Ranged attack power * 0.039 + 62 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 94 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] de dano de Fogo a todos os inimigos em um raio de 8 m. Além disso, a carga causará dano novamente, a cada segundo, por mais 2 sec."},
