[411624] = {name = "Domar Fera", additional_info = "Alcance de 30m\nInstantâneo\n[q]Começa a domar uma fera para ser sua ajudante. Sua Armadura fica reduzida em 100% por 20 sec enquanto você se concentra em domar a fera. Se você perder a atenção da fera por qualquer razão, o processo será interrompido. Depois de domada, ela ficará infeliz e desleal. Alimente-a imediatamente para deixá-la feliz."},
[411631] = {name = "Domar Fera", additional_info = "{60% de base mana} {Alcance de 30m}\nCanalizado (20 seg de lançamento)\n[q]Começa a domar uma fera para ser sua ajudante. Sua Armadura fica reduzida em 100% por 20 sec enquanto você se concentra em domar a fera. Se você perder a atenção da fera por qualquer razão, o processo será interrompido. Depois de domada, ela ficará infeliz e desleal. Alimente-a imediatamente para deixá-la feliz."},
