[412018] = {name = "Escudo Sagrado", additional_info = "Alcance ilimitado\nInstantâneo\n[q]Toda vez que recebe dano, o alvo ganha um Escudo Sagrado que absorve 36 de dano e aumenta em 50% a chance de acerto crítico do Paladino com Clarão de Luz por até 6 sec. Não é possível ganhar este efeito mais de uma vez a cada 6 s. Dura 6 sec."},
[412019] = {name = "Escudo Sagrado", additional_info = "{12% de base mana} {Alcance de 40m}\nInstantâneo\n[q]Toda vez que recebe dano, o alvo ganha um Escudo Sagrado que absorve [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] de dano e aumenta em 50% a chance de acerto crítico do Paladino com Clarão de Luz por 6 sec. Além disso, faz seu Clarão de Luz curar mais 100% dos pontos de vida dos alvos com Escudo Sagrado ao longo de 12 sec. Não é possível ganhar este efeito mais de uma vez a cada 6 s. Dura 1 min. Este feitiço não pode afetar mais de um alvo por vez."},
