[412096] = {name = "Tempestade Carmesim", additional_info = "{35 de Energia} {Alcance de 8m}\nInstantâneo\nRequer Arma corpo a corpo\n[q]Golpe finalizador que corta todos os inimigos em um raio de 8 m, fazendo as vítimas Sangrarem ao longo do tempo. Dura mais e causa mais dano por ponto de combo.\n\n 1 ponto: (Attack power * 0.30) de dano durante 4 s.\n 2 pontos: (Attack power * 0.45) de dano durante 6 s.\n 3 pontos: (Attack power * 0.60) de dano durante 8 s.\n 4 pontos: (Attack power * 0.75) de dano durante 10 s.\n 5 pontos: (Attack power * 0.90) de dano durante 12 s.\n\n A Tempestade Carmesim se beneficia de todos os talentos e efeitos que sejam acionados pela Ruptura ou a modifiquem."},
