[412115] = {name = "Proteção Avançada", additional_info = "[q]Seus feitiços Escudo de Mana, Proteção contra Gelo e Proteção contra Fogo agora podem ser lançados em qualquer alvo aliado e absorvem 100% a mais de dano, com Escudo de Mana consumindo 50% menos pontos de mana por ponto de dano absorvido. Além disso, seu Remover Maldição Inferior é substituído por Remover Maldição Superior.\n\n\nRemove 1 Maldição e 1 efeito mágico nocivo de um alvo aliado."},
[412116] = {name = "Escudo de Mana", additional_info = "{40 de Mana} {Alcance de 40m}\nInstantâneo\n[q]Absorve 240 de dano Físico de um alvo aliado, drenando mana. Drena 1 pontos de mana do Mago lançador por dano absorvido. Dura 1 min."},
