[412507] = {name = "Frenesi de Sangue", additional_info = "[q]Dilacerar agora pode ser usado na postura do Berserker, dano de Dilacerar aumentado em 100%, e Dilacerar causa dano adicional equivalente a 3% do seu Poder de Ataque sempre que causa dano."},
[412510] = {name = "Regeneração em Massa", additional_info = "{45% de base mana} {Alcance de 40m}\n{Canalizado (3 seg de lançamento} {) 6 seg de recarga}\n[q]Cura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida de todos os membros do grupo do jogador selecionado em um raio de 43.5 m dele ao longo de 3 sec, e aplica Foco Temporal em cada alvo por 15 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[412513] = {name = "Postura do Gladiador", additional_info = "{Instantâneo} {1 seg de recarga}\n[q]Postura agressiva que aumenta em 10% o dano quando você está usando um escudo e aumenta em 10% a chance de bloquear, mas reduz em 30% a armadura e em 30% a ameaça gerada. Além disso, você ganha 50% a mais de Raiva quando seu ataque automático causa dano a um inimigo que não esteja alvejando você.\n\n Ao usar um escudo na Postura do Gladiador, você pode usar todas as habilidades restritas a outras posturas."},
[412526] = {name = "Açoite Mental", additional_info = "Alcance ilimitado\nCanalizado (10 seg de lançamento)\n[q]Causa dano de Sombra a um inimigo e reduz a velocidade de movimento dele por 10 sec."},
