[415326] = {name = "Ataque Flanqueante", additional_info = "Alcance corpo a corpo\nInstantâneo\n[q]Você e sua mascote causam simultaneamente 100% de dano corpo a corpo. Depois disso, sua Mordida de Mangusto e seu Golpe do Raptor causam 0% a mais de dano por until cancelled, acumulando até 1 vezes. Golpe do Raptor tem 0% de chance de reiniciar a recarga de Ataque Flanqueante."},
[415327] = {name = "Ataque Flanqueante", additional_info = nil},
[415335] = {name = "Golpe do Raptor", additional_info = "{15 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 5 o dano corpo a corpo."},
[415336] = {name = "Golpe do Raptor", additional_info = "{25 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 11 o dano corpo a corpo."},
[415337] = {name = "Golpe do Raptor", additional_info = "{35 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 21 o dano corpo a corpo."},
[415338] = {name = "Golpe do Raptor", additional_info = "{45 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 34 o dano corpo a corpo."},
[415340] = {name = "Golpe do Raptor", additional_info = "{55 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 50 o dano corpo a corpo."},
[415341] = {name = "Golpe do Raptor", additional_info = "{70 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 80 o dano corpo a corpo."},
[415342] = {name = "Golpe do Raptor", additional_info = "{85 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 110 o dano corpo a corpo."},
[415343] = {name = "Golpe do Raptor", additional_info = "{100 de Mana} {Alcance corpo a corpo}\n{Instantâneo} {6 seg de recarga}\nRequer Arma corpo a corpo\n[q]Um forte ataque que aumenta em 140 o dano corpo a corpo."},
[415352] = {name = "Especialista em Corpo a Corpo", additional_info = "[q]Mordida de Mangusto e Golpe do Raptor têm 30% de chance a cada ataque de concluir as recargas de Mordida de Mangusto e Golpe do Raptor."},
[415358] = {name = "Fúria do Raptor", additional_info = "[q]Golpe do Raptor aumenta em 15% o dano causado pelo Golpe do Raptor e pela Mordida de Mangusto por 30 sec, acumulando até 5 vezes. Doses subsequentes não prolongam a duração do efeito."},
[415362] = {name = "Fúria do Raptor", additional_info = "Instantâneo\n[q]Modifies Damage/Healing Done +16%:\nGolpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Golpe do Raptor , Mordida de Mangusto , Mordida de Mangusto , Mordida de Mangusto , Mordida de Mangusto"},
[415370] = {name = "Lobo Solitário", additional_info = "[q]Você causa 30% a mais de dano com todos os ataques quando não tiver um ajudante ativo."},
[415372] = {name = "Lobo Solitário", additional_info = nil},
[415399] = {name = "Treinamento de Franco-atirador", additional_info = "[q]Suas habilidades de Tiro ganham 2% a mais de chance de acerto crítico quando você passa 2 s sem se mover, acumulando a cada segundo até 5 vezes. Na 5 aplicação, o Tiro Certo torna-se instantâneo. Ao se mover, você perderá 1 aplicação por segundo."},
[415401] = {name = "Treinamento de Franco-atirador", additional_info = "Instantâneo\n[q]Modifies Critical Strike Chance +3:\nTiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Explosivo , Tiro Explosivo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Quimérico , Tiro Quimérico - Serpente , Tiro de Concussão , Tiro de Dispersão"},
[415405] = {name = "Matança Veloz", additional_info = "[q]Reduz em 80% a recarga de Tiro Rápido, que agora também concede 40% a mais de velocidade de ataque corpo a corpo, e sua próxima habilidade de Tiro causa 20% a mais de dano se ocorrer dentro de 20 sec após matar um alvo que conceda experiência ou honra."},
[415407] = {name = "Matança Veloz", additional_info = "Instantâneo\n[q]Modifies Damage/Healing Done +21%:\nTiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Explosivo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Quimérico , Tiro Quimérico - Serpente , Tiro de Concussão , Tiro de Dispersão"},
[415413] = {name = "Largar o Dedo", additional_info = "[q]Sempre que uma das suas armadilhas é acionada, sua próxima habilidade de Tiro (exceto Tiro de Dispersão) dentro de 20 sec não custa mana e não aciona a recarga."},
[415414] = {name = "Largar o Dedo", additional_info = "Instantâneo\n[q]Modifies Cooldown -99%:\nTiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Explosivo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Quimérico , Tiro Quimérico - Serpente , Tiro de Concussão\n\nModifies Power Cost -99%:\nTiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Arcano , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Certo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Distrativo , Tiro Explosivo , Tiro Explosivo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Múltiplo , Tiro Quimérico , Tiro Quimérico - Serpente , Tiro de Concussão"},
[415423] = {name = "Aspecto da Víbora", additional_info = "Instantâneo\n[q]O Caçador assume o aspecto da víbora, fazendo com que seus ataques automáticos de longo alcance e corpo a corpo regenerem mana, mas reduzindo em 10% o dano total causado. Além disso, você recebe 10% do máximo de pontos de mana a cada 3 s. O mana é recebido com base na velocidade da sua arma. Somente um Aspecto pode estar ativo por vez."},
[415424] = {name = "Aspecto da Víbora", additional_info = nil},
[415428] = {name = "Reflexos Felinos", additional_info = "[q]Aumenta em 20% a sua chance de esquiva e em 9% a chance de esquiva do seu ajudante. Além disso, reduz em 50% a recarga da sua habilidade Ataque Flanqueante."},
[415429] = {name = "Ajuste de Ajudante de Caçador", additional_info = nil},
[415431] = {name = "Evasiva", additional_info = nil},
[415449] = {name = "Habilidade de Runa de Cintura", additional_info = "Instantâneo\n[q]Equipa um item do espaço da Cintura com uma Runa gravada para ativar uma habilidade neste espaço."},
[415450] = {name = "Habilidade de Runa de Pés", additional_info = "Instantâneo\n[q]Equipa um item do espaço dos Pés com uma Runa gravada para ativar uma habilidade neste espaço."},
[415452] = {name = "Patada Aprimorada", additional_info = "[q]Concede a habilidade Patada Aprimorada:\n\n\nNa Forma de Felino, sua habilidade Patada se torna Patada (Felino), e na Forma de Urso, sua Patada atinge até 7 inimigos a mais.\n\n Patada (Felino)\n\nGolpeia inimigos próximos, causando 250% do dano da arma e gerando 1 ponto de combo; no seu alvo atual."},
[415457] = {name = "Leque de Facas", additional_info = "[q]Concede a habilidade Leque de Facas:\n\n\nLança instantaneamente ambas as armas em todos os alvos em um raio de 8 m, causando 75% do dano da arma com adagas e 50% do dano da arma com todas as outras armas."},
[415459] = {name = "Poder Mágico", additional_info = "[q]Concede a habilidade Poder Mágico:\n\n\nAumenta em 50% o bônus de dano de acerto crítico de todos os feitiços."},
[415460] = {name = "Combustão", additional_info = "[q]Concede a habilidade Combustão:\n\n\nAumenta em 15% sua chance de acerto crítico com todos os feitiços, mas seus acertos críticos com feitiços não periódicos agora têm um custo adicional de 1% do seu mana básico."},
[415467] = {name = "Regeneração em Massa", additional_info = "[q]Concede a habilidade Regeneração em Massa:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida de todos os membros do grupo do jogador selecionado em um raio de 43.5 m dele ao longo de 3 sec, e aplica Foco Temporal em cada alvo por 15 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[415481] = {name = "Dor e Sofrimento", additional_info = "[q]Concede a habilidade Dor e Sofrimento:\n\n\nImpacto Mental, Aguilhão Mental e Açoite Mental renovam a duração das suas habilidades Palavra Sombria: Dor, Peste do Caos ou Toque Vampírico no alvo de volta para a duração máxima. A habilidade com menor duração restante sempre é renovada."},
[415596] = {name = "Proficiência em Escudo", additional_info = "[q]Concede a habilidade Proficiência em Escudo:"},
[415598] = {name = "Postura do Gladiador", additional_info = "[q]Concede a habilidade Postura do Gladiador:\n\n\nPostura agressiva que aumenta em 10% o dano quando você está usando um escudo e aumenta em 10% a chance de bloquear, mas reduz em 30% a armadura e em 30% a ameaça gerada. Além disso, você ganha 50% a mais de Raiva quando seu ataque automático causa dano a um inimigo que não esteja alvejando você.\n\n Ao usar um escudo na Postura do Gladiador, você pode usar todas as habilidades restritas a outras posturas."},
[415599] = {name = "Fúria Obcecada", additional_info = "[q]Concede a habilidade Fúria Obcecada:\n\n\nAo empunhar duas armas, sua velocidade de movimento aumenta em 10% e você ganha 2% de velocidade de ataque sempre que seu ataque automático corpo a corpo atinge o mesmo alvo que o ataque automático anterior, acumulando até 5 vezes. Dura 10 sec ou até seu ataque automático atingir outro alvo."},
[415604] = {name = "Agonia Eterna", additional_info = "[q]Concede a habilidade Agonia Eterna:\n\n\nDrenar Vida, Drenar Alma, Seta Sombria, Cutilada Sombria, Dor Lancinante, Incinerar e Assombrar renovam a duração da sua Corrupção no alvo de volta para a duração máxima."},
[415605] = {name = "Táticas Demoníacas", additional_info = "[q]Concede a habilidade Táticas Demoníacas:\n\n\nAumenta em 10% a chance de acerto crítico com feitiços e corpo a corpo do seu ajudante."},
[415703] = {name = "Escudo Sagrado", additional_info = "[q]Concede a habilidade Escudo Sagrado:\n\n\nToda vez que recebe dano, o alvo ganha um Escudo Sagrado que absorve [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] de dano e aumenta em 50% a chance de acerto crítico do Paladino com Clarão de Luz por 6 sec. Além disso, faz seu Clarão de Luz curar mais 100% dos pontos de vida dos alvos com Escudo Sagrado ao longo de 12 sec. Não é possível ganhar este efeito mais de uma vez a cada 6 s. Dura 1 min. Este feitiço não pode afetar mais de um alvo por vez."},
[415706] = {name = "A Arte da Guerra", additional_info = "[q]Concede a habilidade Arte da Guerra:\n\n\nSeus acertos críticos corpo a corpo reduzem em 2 s a recarga restante de Exorcismo, e o custo de mana do Exorcismo é reduzido em 80%."},
[415709] = {name = "A Lei da Selva", additional_info = "[q]Concede a habilidade Lei da Selva:\n\n\nReduz em 6% a chance de você receber acertos críticos de ataques corpo a corpo e em 10% todo o dano recebido. Dano recebido reduzido em mais 10% na Forma de Urso ou de Urso Hediondo."},
[415712] = {name = "Surto de Poder", additional_info = "[q]Concede a habilidade Surto de Poder:\n\n\nCada dano de Choque Flamejante tem 5% de chance de concluir a recarga de Estouro de Lava e Cadeia de Raios, além de tornar o próximo Estouro de Lava ou Cadeia de Raios dentro de 10 sec instantâneo. Cada cura de Contracorrente tem 5% de chance de fazer sua próxima Cura Encadeada dentro de 10 sec instantânea. Além disso, a cada 5 s você ganha mana equivalente a 15% do seu Intelecto."},
[415713] = {name = "Destreza Mental", additional_info = "[q]Concede a habilidade Destreza Mental:\n\n\nCausar dano com Açoite de Lava ou Ataque da Tempestade aumenta seu poder de ataque em 100% do seu Intelecto, e seu dano mágico em 35% do seu poder de ataque total por 30 sec."},
[415714] = {name = "Chuva Curativa", additional_info = "[q]Concede a habilidade Chuva Curativa:\n\n\nSeleciona uma área de 15 m ao redor do alvo e cura [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] pontos de vida a cada segundo de todos os integrantes do grupo dele dentro da área."},
[415717] = {name = "Reflexos Felinos", additional_info = "[q]Concede a habilidade Reflexos Felinos:\n\n\nAumenta em 20% a sua chance de esquiva e em 9% a chance de esquiva do seu ajudante. Além disso, reduz em 50% a recarga da sua habilidade Ataque Flanqueante."},
[415718] = {name = "Aspecto da Víbora", additional_info = "[q]Concede a habilidade Aspecto da Víbora:\n\n\nO Caçador assume o aspecto da víbora, fazendo com que seus ataques automáticos de longo alcance e corpo a corpo regenerem mana, mas reduzindo em 10% o dano total causado. Além disso, você recebe 10% do máximo de pontos de mana a cada 3 s. O mana é recebido com base na velocidade da sua arma. Somente um Aspecto pode estar ativo por vez."},
[415719] = {name = "Largar o Dedo", additional_info = "[q]Concede a habilidade Largar o Dedo:\n\n\nSempre que uma das suas armadilhas é acionada, sua próxima habilidade de Tiro (exceto Tiro de Dispersão) dentro de 20 sec não custa mana e não aciona a recarga."},
[415720] = {name = "Tiro Mortal", additional_info = "[q]Concede a habilidade Tiro Mortal:\n\n\nVocê tenta executar o alvo ferido com um ataque de longo alcance que causa 100% do dano da arma mais [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]. Tiro Mortal não tem alcance mínimo e recarrega se for usado em um inimigo com 20% ou menos do total de pontos de vida."},
[415723] = {name = "Especialista em Corpo a Corpo", additional_info = "[q]Concede a habilidade Especialista em Corpo a Corpo:\n\n\nMordida de Mangusto e Golpe do Raptor têm 30% de chance a cada ataque de concluir as recargas de Mordida de Mangusto e Golpe do Raptor."},
[415725] = {name = "Atocaiar", additional_info = "[q]Concede a habilidade Atocaiar:\n\n\nSeus acertos com Emboscar e Punhalada pelas Costas desequilibram o alvo, aumentado em 10% o intervalo entre os ataques corpo a corpo dele e reduzindo em 50% a velocidade de movimento por 8 sec."},
[415729] = {name = "Esclarecimento", additional_info = "[q]Concede a habilidade Esclarecimento:\n\n\nVocê causa 10% mais dano quando tem mais de 70% dos pontos de mana. Abaixo de 30% dos pontos de mana, 10% da sua regeneração de mana continua durante o lançamento."},
[415734] = {name = "Seta de Gelo Mágico", additional_info = "[q]Concede a habilidade Seta de Gelo Mágico:\n\n\nLança uma seta de gelo mágico contra o inimigo, causando de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] de dano de Gelo Mágico e reduzindo em 40% a velocidade de movimento por 9 sec. Este feitiço age de acordo com a resistência de Gelo ou Arcana mais baixa do alvo e conta tanto como dano de Gelo quanto Arcano."},
[415737] = {name = "Serendipidade", additional_info = "[q]Concede a habilidade Serendipidade:\n\n\nCurar com Cura Célere reduz em 20% o tempo de lançamento da sua próxima Cura Inferior, Cura, Cura Maior ou Prece de Cura por 20 sec, acumulando até 3 vezes."},
[415738] = {name = "Calcinação Mental", additional_info = "[q]Concede a habilidade Calcinação Mental:\n\n\nDeflagra uma explosão de magia sombria que causa dano ao alvo e outros inimigos próximos, causando de [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] a [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] de dano de Sombra a cada 1 s por 5 sec a todos os inimigos em um raio de 10 m do alvo."},
[415739] = {name = "Força da Alma", additional_info = "[q]Cura Inferior, Cura, Cura Maior e Cura Célere reduzem em 4 s a duração restante de Alma Enfraquecida nos alvos que curam. Além disso, alvos da sua Palavra de Poder: Escudo ganham Raiva ao receber dano, independentemente de o dano ser absorvido, e Fúria Íntegra se ativa com dano absorvido pela sua Palavra de Poder: Escudo como se fosse uma cura."},
[415740] = {name = "Força da Alma", additional_info = "[q]Concede a habilidade Força da Alma:\n\n\nCura Inferior, Cura, Cura Maior e Cura Célere reduzem em 4 s a duração restante de Alma Enfraquecida nos alvos que curam. Além disso, alvos da sua Palavra de Poder: Escudo ganham Raiva ao receber dano, independentemente de o dano ser absorvido, e Fúria Íntegra se ativa com dano absorvido pela sua Palavra de Poder: Escudo como se fosse uma cura."},
[415743] = {name = "Rebentação de Sangue", additional_info = "[q]Concede a habilidade Rebentação de Sangue:\n\n\nGolpe Heroico, Sede de Sangue e Redemoinho têm 30% de chance de fazer sua próxima Batida em até 15 sec ser instantânea, atacar com ambas as armas corpo a corpo e não custar Raiva."},
[415744] = {name = "Momento Exato", additional_info = "[q]Concede a habilidade Momento Exato:\n\n\nBatida agora é instantânea, mas tem uma recarga de 6 s."},
[415745] = {name = "Raiva Concentrada", additional_info = "[q]Concede a habilidade Raiva Concentrada:\n\n\nReduz em 3 o custo de Raiva das suas habilidades ofensivas."},
[415749] = {name = "Conhecimento Demoníaco", additional_info = "[q]Concede a habilidade Conhecimento Demoníaco:\n\n\nAumenta seu dano mágico e sua cura em um valor equivalente a 3% da soma total do Vigor e do Intelecto do seu demônio ajudante."},
[415750] = {name = "Incinerar", additional_info = "[q]Concede a habilidade Incinerar:\n\n\nQueima o inimigo, causando de [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] a [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] de dano e aumentando em 40% todo o dano de Fogo que você causa pelos próximos 15 sec."},
[415751] = {name = "Dança dos Perversos", additional_info = "[q]Concede a habilidade Dança dos Perversos:\n\n\nVocê e seu demônio ajudante ganham chance de esquiva equivalente à sua chance de acerto crítico com feitiços toda vez que você obtém um acerto crítico em um inimigo, e ambos também recuperam 2% do máximo de pontos de mana."},
[415755] = {name = "Protegido pela Luz", additional_info = "[q]Concede a habilidade Protegido pela Luz:\n\n\nToda vez que atinge um alvo com a arma corpo a corpo, você recebe 5% do seu máximo de pontos de mana ao longo de 3 s, por 15 sec, mas seus feitiços de Cura recuperam 50% menos pontos durante a regeneração de mana."},
[415756] = {name = "Proficiência em Auras", additional_info = "[q]Concede a habilidade Proficiência em Auras:\n\n\nFaz sua Aura de Concentração deixar todos os alvos afetados imunes a efeitos de silêncio e interrupção, aumentando em 100% o efeito de todas as outras auras. Dura 6 sec."},
[415759] = {name = "Esmagar Crânio", additional_info = "[q]Concede a habilidade Esmagar Crânio:\n\n\nInveste contra um alvo em um raio de 13 m e esmaga seu crânio, interrompendo o lançamento de feitiços e impedindo que qualquer feitiço da mesma escola seja lançado por 2 sec. Compartilha a recarga com Investida Feral."},
[415760] = {name = "Lacerar", additional_info = "[q]Concede a habilidade Lacerar:\n\n\nLacera o alvo inimigo, fazendo-o [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] receber de dano ao longo de 15 sec, mais 20% do dano da arma por aplicação existente de Lacerar no alvo. Causa uma grande quantidade de ameaça. Este efeito acumula até 5 vezes no mesmo alvo."},
[415761] = {name = "Semente Viva", additional_info = "[q]Concede a habilidade Semente Viva:\n\n\nQuando realiza uma cura crítica com qualquer feitiço de cura não periódica, você planta no alvo uma Semente Viva que cura mais 50% do total curado. A Semente Viva floresce da próxima vez que o alvo receber dano ou cura não periódica. Dura 15 sec."},
[415762] = {name = "Chamas de Eluna", additional_info = "[q]Concede a habilidade de Chamas de Eluna:\n\n\nAlguns dos seus feitiços e habilidades prolongam a duração dos seus efeitos de dano e cura ao longo do tempo no alvo:\n\n Fogo Estelar prolonga em 6 s Fogo Lunar.\n Ira prolonga em 3 s Fogo Solar.\n Recrescimento prolonga em 6 s Rejuvenescer.\n Despedaçar prolonga em 1 s Rasgar.\n\n Cada efeito só pode ser prolongado pela duração inicial."},
[415768] = {name = "Queimadura", additional_info = "[q]Concede a habilidade Queimadura:\n\n\nYour Flame Shock now strikes up to 5 targets, gains 6 sec increased duration, and deals 100% increased damage. In addition, while you have Flametongue Weapon imbued on your main hand equipped weapon, you gain increased spell damage equal to your Intellect."},
[415813] = {name = "Lobo Fantasma Maior", additional_info = "[q]Sua habilidade Lobo Fantasma agora pode ser usada em ambientes internos e reduz em 10% todo o dano que você recebe quando o efeito está ativo."},
[415816] = {name = "Golpe da Mantícora", additional_info = "[q]Concede a habilidade Golpe da Mantícora:\n\n\nSubstitui sua habilidade Picada de Mantícora por Golpe da Mantícora, um golpe cruel que causa 140% do dano da arma e faz o alvo sangrar, recebendo dano ao longo do tempo.\n\n Golpe da Mantícora requer o talento Picada de Mantícora e substitui as habilidades de Picada de Mantícora presentes no grimório Sobrevivência."},
[415817] = {name = "Matança Veloz", additional_info = "[q]Concede a habilidade Matança Veloz:\n\n\nReduz em 80% a recarga de Tiro Rápido, que agora também concede 40% a mais de velocidade de ataque corpo a corpo, e sua próxima habilidade de Tiro causa 20% a mais de dano se ocorrer dentro de 20 sec após matar um alvo que conceda experiência ou honra."},
[415818] = {name = "Treinamento de Franco-atirador", additional_info = "[q]Concede a habilidade Treinamento de Franco-atirador:\n\n\nSuas habilidades de Tiro ganham 2% a mais de chance de acerto crítico quando você passa 2 s sem se mover, acumulando a cada segundo até 5 vezes. Na 5 aplicação, o Tiro Certo torna-se instantâneo. Ao se mover, você perderá 1 aplicação por segundo."},
[415822] = {name = "Fúria do Raptor", additional_info = "[q]Concede a habilidade Fúria do Raptor:\n\n\nGolpe do Raptor aumenta em 15% o dano causado pelo Golpe do Raptor e pela Mordida de Mangusto por 30 sec, acumulando até 5 vezes. Doses subsequentes não prolongam a duração do efeito."},
[415918] = {name = "Gravar Manto - Tempestade Carmesim", additional_info = "3 seg de lançamento\nRequer Manto\n[q]Grava no manto a runa de Tempestade Carmesim:\n\n\nGolpe finalizador que corta todos os inimigos em um raio de 8 m, fazendo as vítimas Sangrarem ao longo do tempo. Dura mais e causa mais dano por ponto de combo.\n\n 1 ponto: (Attack power * 0.30) de dano durante 4 s.\n 2 pontos: (Attack power * 0.45) de dano durante 6 s.\n 3 pontos: (Attack power * 0.60) de dano durante 8 s.\n 4 pontos: (Attack power * 0.75) de dano durante 10 s.\n 5 pontos: (Attack power * 0.90) de dano durante 12 s.\n\n A Tempestade Carmesim se beneficia de todos os talentos e efeitos que sejam acionados pela Ruptura ou a modifiquem."},
[415922] = {name = "Gravar Manto - Bacamarte", additional_info = "3 seg de lançamento\nRequer Manto\n[q]Grava no manto a runa de Bacamarte:\n\n\nDispara um mosquete contra até 4 inimigos em uma área cônica à frente, causando de [(5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 192 / 100 + 48 / 100 * Attack power] a [(5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 288 / 100 + 48 / 100 * Attack power] de dano Físico."},
[415926] = {name = "Gravar Botas - Atocaiar", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Atocaiar:\n\n\nSeus acertos com Emboscar e Punhalada pelas Costas desequilibram o alvo, aumentado em 10% o intervalo entre os ataques corpo a corpo dele e reduzindo em 50% a velocidade de movimento por 8 sec."},
[415934] = {name = "Gravar Botas - Poder Mágico", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Poder Mágico:\n\n\nAumenta em 50% o bônus de dano de acerto crítico de todos os feitiços."},
[415936] = {name = "Gravar Luvas - Bomba Viva", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Bomba Viva:\n\n\nO alvo se torna uma Bomba Viva, recebendo [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] de dano de Fogo ao longo de 12 sec. Depois de 12 sec ou quando o feitiço for dissipado, o alvo explode, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] de dano de Fogo a todos os inimigos em um raio de 10 m."},
[415939] = {name = "Gravar Calça - Regeneração em Massa", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Regeneração em Massa:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida de todos os membros do grupo do jogador selecionado em um raio de 43.5 m dele ao longo de 3 sec, e aplica Foco Temporal em cada alvo por 15 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos."},
[415942] = {name = "Gravar Peitoral - Esclarecimento", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Esclarecimento:\n\n\nVocê causa 10% mais dano quando tem mais de 70% dos pontos de mana. Abaixo de 30% dos pontos de mana, 10% da sua regeneração de mana continua durante o lançamento."},
[415948] = {name = "Gravar Cinto - Seta de Gelo Mágico", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Seta de Gelo Mágico:\n\n\nLança uma seta de gelo mágico contra o inimigo, causando de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 305 / 100 * ( 1 ) ] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 355 / 100 * ( 1 ) ] de dano de Gelo Mágico e reduzindo em 40% a velocidade de movimento por 9 sec. Este feitiço age de acordo com a resistência de Gelo ou Arcana mais baixa do alvo e conta tanto como dano de Gelo quanto Arcano."},
[415988] = {name = "Vahi Rachaosso - Trocar Cabeça de Centauro por Fragmento de Runa", additional_info = nil},
[415991] = {name = "Gravar Elmo - Dor e Sofrimento", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Dor e Sofrimento:\n\n\nImpacto Mental, Aguilhão Mental e Açoite Mental renovam a duração das suas habilidades Palavra Sombria: Dor, Peste do Caos ou Toque Vampírico no alvo de volta para a duração máxima. A habilidade com menor duração restante sempre é renovada."},
[415995] = {name = "Gravar Peitoral - Serendipidade", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Serendipidade:\n\n\nCurar com Cura Célere reduz em 20% o tempo de lançamento da sua próxima Cura Inferior, Cura, Cura Maior ou Prece de Cura por 20 sec, acumulando até 3 vezes."},
[415996] = {name = "Gravar Luvas - Calcinação Mental", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Calcinação Mental:\n\n\nDeflagra uma explosão de magia sombria que causa dano ao alvo e outros inimigos próximos, causando de [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] a [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] de dano de Sombra a cada 1 s por 5 sec a todos os inimigos em um raio de 10 m do alvo."},
[415997] = {name = "Gravar Peitoral - Força da Alma", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou peitoral a runa de Força da Alma:\n\n\nCura Inferior, Cura, Cura Maior e Cura Célere reduzem em 4 s a duração restante de Alma Enfraquecida nos alvos que curam. Além disso, alvos da sua Palavra de Poder: Escudo ganham Raiva ao receber dano, independentemente de o dano ser absorvido, e Fúria Íntegra se ativa com dano absorvido pela sua Palavra de Poder: Escudo como se fosse uma cura."},
[416002] = {name = "Gravar Botas - Postura do Gladiador", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Postura do Gladiador:\n\n\nPostura agressiva que aumenta em 10% o dano quando você está usando um escudo e aumenta em 10% a chance de bloquear, mas reduz em 30% a armadura e em 30% a ameaça gerada. Além disso, você ganha 50% a mais de Raiva quando seu ataque automático causa dano a um inimigo que não esteja alvejando você.\n\n Ao usar um escudo na Postura do Gladiador, você pode usar todas as habilidades restritas a outras posturas."},
[416003] = {name = "Gravar Cinto - Fúria Obcecada", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Fúria Obcecada:\n\n\nAo empunhar duas armas, sua velocidade de movimento aumenta em 10% e você ganha 2% de velocidade de ataque sempre que seu ataque automático corpo a corpo atinge o mesmo alvo que o ataque automático anterior, acumulando até 5 vezes. Dura 10 sec ou até seu ataque automático atingir outro alvo."},
[416004] = {name = "Gravar Cinto - Rebentação de Sangue", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Rebentação de Sangue:\n\n\nGolpe Heroico, Sede de Sangue e Redemoinho têm 30% de chance de fazer sua próxima Batida em até 15 sec ser instantânea, atacar com ambas as armas corpo a corpo e não custar Raiva."},
[416005] = {name = "Gravar Cinto - Momento Exato", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Momento Exato:\n\n\nBatida agora é instantânea, mas tem uma recarga de 6 s."},
[416008] = {name = "Gravura Calça - Agonia Eterna", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Agonia Eterna:\n\n\nDrenar Vida, Drenar Alma, Seta Sombria, Cutilada Sombria, Dor Lancinante, Incinerar e Assombrar renovam a duração da sua Corrupção no alvo de volta para a duração máxima."},
[416009] = {name = "Gravar Peitoral - Táticas Demoníacas", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Táticas Demoníacas:\n\n\nAumenta em 10% a chance de acerto crítico com feitiços e corpo a corpo do seu ajudante."},
[416014] = {name = "Gravar Botas - Conhecimento Demoníaco", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Conhecimento Demoníaco:\n\n\nAumenta seu dano mágico e sua cura em um valor equivalente a 3% da soma total do Vigor e do Intelecto do seu demônio ajudante."},
[416015] = {name = "Gravar Braçadeiras - Incinerar", additional_info = "3 seg de lançamento\nRequer Braçadeiras\n[q]Grava nas braçadeiras a runa de Incinerar:\n\n\nQueima o inimigo, causando de [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] a [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] de dano e aumentando em 40% todo o dano de Fogo que você causa pelos próximos 15 sec."},
[416017] = {name = "Gravar Botas - Dança dos Perversos", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Dança dos Perversos:\n\n\nVocê e seu demônio ajudante ganham chance de esquiva equivalente à sua chance de acerto crítico com feitiços toda vez que você obtém um acerto crítico em um inimigo, e ambos também recuperam 2% do máximo de pontos de mana."},
[416028] = {name = "Gravar Botas - Escudo Sagrado", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Escudo Sagrado:\n\n\nToda vez que recebe dano, o alvo ganha um Escudo Sagrado que absorve [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] de dano e aumenta em 50% a chance de acerto crítico do Paladino com Clarão de Luz por 6 sec. Além disso, faz seu Clarão de Luz curar mais 100% dos pontos de vida dos alvos com Escudo Sagrado ao longo de 12 sec. Não é possível ganhar este efeito mais de uma vez a cada 6 s. Dura 1 min. Este feitiço não pode afetar mais de um alvo por vez."},
[416031] = {name = "Gravar Botas - A Arte da Guerra", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Arte da Guerra:\n\n\nSeus acertos críticos corpo a corpo reduzem em 2 s a recarga restante de Exorcismo, e o custo de mana do Exorcismo é reduzido em 80%."},
[416035] = {name = "Gravar Botas - Protegido pela Luz", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Protegido pela Luz:\n\n\nToda vez que atinge um alvo com a arma corpo a corpo, você recebe 5% do seu máximo de pontos de mana ao longo de 3 s, por 15 sec, mas seus feitiços de Cura recuperam 50% menos pontos durante a regeneração de mana."},
[416037] = {name = "Gravar Calça - Proficiência em Auras", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Proficiência em Auras:\n\n\nFaz sua Aura de Concentração deixar todos os alvos afetados imunes a efeitos de silêncio e interrupção, aumentando em 100% o efeito de todas as outras auras. Dura 6 sec."},
[416042] = {name = "Gravar Peitoral - A Lei da Selva", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou peitoral a runa de Lei da Selva:\n\n\nReduz em 6% a chance de você receber acertos críticos de ataques corpo a corpo e em 10% todo o dano recebido. Dano recebido reduzido em mais 10% na Forma de Urso ou de Urso Hediondo."},
[416044] = {name = "Gravar Luvas - Fogo Solar", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Fogo Solar:\n\n\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec.\n\n Além disso, na Forma de Urso, de Felino ou de Urso Hediondo, seu Fogo Lunar é substituído por Fogo Solar (Urso) ou Fogo Solar (Felino). Este feitiço se beneficia de todos os efeitos associados ao Fogo Lunar e os ativa.\n\n Fogo Solar (Urso)\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec.\n\n Fogo Solar (Felino)\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec. Concede 1 ponto de combo;."},
[416046] = {name = "Gravar Luvas - Esmagar Crânio", additional_info = "3 seg de lançamento\nRequer Luvas\n[q]Grava nas luvas a runa de Esmagar Crânio:\n\n\nInveste contra um alvo em um raio de 13 m e esmaga seu crânio, interrompendo o lançamento de feitiços e impedindo que qualquer feitiço da mesma escola seja lançado por 2 sec. Compartilha a recarga com Investida Feral."},
[416049] = {name = "Gravar Calça - Lacerar", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Lacerar:\n\n\nLacera o alvo inimigo, fazendo-o [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] receber de dano ao longo de 15 sec, mais 20% do dano da arma por aplicação existente de Lacerar no alvo. Causa uma grande quantidade de ameaça. Este efeito acumula até 5 vezes no mesmo alvo."},
[416050] = {name = "Gravar Peitoral - Semente Viva", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Semente Viva:\n\n\nQuando realiza uma cura crítica com qualquer feitiço de cura não periódica, você planta no alvo uma Semente Viva que cura mais 50% do total curado. A Semente Viva floresce da próxima vez que o alvo receber dano ou cura não periódica. Dura 15 sec."},
[416051] = {name = "Gravar Braçadeiras - Chamas de Eluna", additional_info = "3 seg de lançamento\nRequer Braçadeiras\n[q]Grava nas braçadeiras a runa de Chamas de Eluna:\n\n\nAlguns dos seus feitiços e habilidades prolongam a duração dos seus efeitos de dano e cura ao longo do tempo no alvo:\n\n Fogo Estelar prolonga em 6 s Fogo Lunar.\n Ira prolonga em 3 s Fogo Solar.\n Recrescimento prolonga em 6 s Rejuvenescer.\n Despedaçar prolonga em 1 s Rasgar.\n\n Cada efeito só pode ser prolongado pela duração inicial."},
[416054] = {name = "Gravar Cinto - Surto de Poder", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Surto de Poder:\n\n\nCada dano de Choque Flamejante tem 5% de chance de concluir a recarga de Estouro de Lava e Cadeia de Raios, além de tornar o próximo Estouro de Lava ou Cadeia de Raios dentro de 10 sec instantâneo. Cada cura de Contracorrente tem 5% de chance de fazer sua próxima Cura Encadeada dentro de 10 sec instantânea. Além disso, a cada 5 s você ganha mana equivalente a 15% do seu Intelecto."},
[416055] = {name = "Gravar Elmo - Destreza Mental", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Destreza Mental:\n\n\nCausar dano com Açoite de Lava ou Ataque da Tempestade aumenta seu poder de ataque em 100% do seu Intelecto, e seu dano mágico em 35% do seu poder de ataque total por 30 sec."},
[416057] = {name = "Gravar Peitoral - Chuva Curativa", additional_info = "3 seg de lançamento\nRequer Torso, Torso\n[q]Grava na veste ou no peitoral a runa de Chuva Curativa:\n\n\nSeleciona uma área de 15 m ao redor do alvo e cura [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] pontos de vida a cada segundo de todos os integrantes do grupo dele dentro da área."},
[416062] = {name = "Gravar Manto - Coerência", additional_info = "3 seg de lançamento\nRequer Manto\n[q]Grava no manto a runa de Coerência:\n\n\nFaz a eficácia da sua Cura Encadeada só ser reduzida em 35% por salto, e a eficácia da Cadeia de Raios só ser reduzida em 20% por salto. Ambas também saltam para 1 alvo adicional."},
[416066] = {name = "Gravar Elmo - Queimadura", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Queimadura:\n\n\nYour Flame Shock now strikes up to 5 targets, gains 6 sec increased duration, and deals 100% increased damage. In addition, while you have Flametongue Weapon imbued on your main hand equipped weapon, you gain increased spell damage equal to your Intellect."},
[416081] = {name = "Coerência", additional_info = "[q]Concede a habilidade Coerência:\n\n\nFaz a eficácia da sua Cura Encadeada só ser reduzida em 35% por salto, e a eficácia da Cadeia de Raios só ser reduzida em 20% por salto. Ambas também saltam para 1 alvo adicional."},
[416083] = {name = "Gravar Elmo - Reflexos Felinos", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Reflexos Felinos:\n\n\nAumenta em 20% a sua chance de esquiva e em 9% a chance de esquiva do seu ajudante. Além disso, reduz em 50% a recarga da sua habilidade Ataque Flanqueante."},
[416084] = {name = "Gravar Cinto - Aspecto da Víbora", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Aspecto da Víbora:\n\n\nO Caçador assume o aspecto da víbora, fazendo com que seus ataques automáticos de longo alcance e corpo a corpo regenerem mana, mas reduzindo em 10% o dano total causado. Além disso, você recebe 10% do máximo de pontos de mana a cada 3 s. O mana é recebido com base na velocidade da sua arma. Somente um Aspecto pode estar ativo por vez."},
[416085] = {name = "Gravar Elmo - Largar o Dedo", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Largar o Dedo:\n\n\nSempre que uma das suas armadilhas é acionada, sua próxima habilidade de Tiro (exceto Tiro de Dispersão) dentro de 20 sec não custa mana e não aciona a recarga."},
[416086] = {name = "Gravar Cinto - Especialista em Corpo a Corpo", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Especialista em Corpo a Corpo:\n\n\nMordida de Mangusto e Golpe do Raptor têm 30% de chance a cada ataque de concluir as recargas de Mordida de Mangusto e Golpe do Raptor."},
[416087] = {name = "Gravar Cinto - Tiro Mortal", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Tiro Mortal:\n\n\nVocê tenta executar o alvo ferido com um ataque de longo alcance que causa 100% do dano da arma mais [113 / 100 * 100 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]. Tiro Mortal não tem alcance mínimo e recarrega se for usado em um inimigo com 20% ou menos do total de pontos de vida."},
[416089] = {name = "Gravar Botas - Golpe da Mantícora", additional_info = "3 seg de lançamento\nRequer Botas\n[q]Grava nas botas a runa de Golpe da Mantícora:\n\n\nSubstitui sua habilidade Picada de Mantícora por Golpe da Mantícora, um golpe cruel que causa 140% do dano da arma e faz o alvo sangrar, recebendo dano ao longo do tempo.\n\n Golpe da Mantícora requer o talento Picada de Mantícora e substitui as habilidades de Picada de Mantícora presentes no grimório Sobrevivência."},
[416090] = {name = "Gravar Elmo - Matança Veloz", additional_info = "3 seg de lançamento\nRequer Elmos\n[q]Grava no elmo a runa de Matança Veloz:\n\n\nReduz em 80% a recarga de Tiro Rápido, que agora também concede 40% a mais de velocidade de ataque corpo a corpo, e sua próxima habilidade de Tiro causa 20% a mais de dano se ocorrer dentro de 20 sec após matar um alvo que conceda experiência ou honra."},
[416091] = {name = "Gravar Calça - Treinamento de Franco-atirador", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Treinamento de Franco-atirador:\n\n\nSuas habilidades de Tiro ganham 2% a mais de chance de acerto crítico quando você passa 2 s sem se mover, acumulando a cada segundo até 5 vezes. Na 5 aplicação, o Tiro Certo torna-se instantâneo. Ao se mover, você perderá 1 aplicação por segundo."},
[416093] = {name = "Gravar Braçadeiras - Fúria do Raptor", additional_info = "3 seg de lançamento\nRequer Braçadeiras\n[q]Grava nas braçadeiras a runa de Fúria do Raptor:\n\n\nGolpe do Raptor aumenta em 15% o dano causado pelo Golpe do Raptor e pela Mordida de Mangusto por 30 sec, acumulando até 5 vezes. Doses subsequentes não prolongam a duração do efeito."},
