[417141] = {name = "Berserk", additional_info = "{Instantâneo} {3 min de recarga}\n[q]Ao ser ativada, faz suas habilidades Destroçar (Urso) e Lacerar atingirem até 3 alvos, Lacerar não custar Raiva, e Destroçar (Urso) não ter recarga. Também reduz em 50% o custo de energia de todas as habilidades da sua Forma de Felino. Dura 15 sec. Requer Forma de Urso, Forma de Felino ou Forma de Urso Hediondo para se ativar.\n\n Remove Medo e concede imunidade a esse efeito por toda a duração."},
[417145] = {name = "Escornar", additional_info = "[q]Atingir um alvo com Lacerar, Patada ou Espancar tem 15% de chance de concluir a recarga de Destroçar (Urso) e concede 10 de Raiva. Atingir um alvo com Destroçar (Felino) ou Despedaçar tem 15% de chance de concluir a recarga da Fúria do Tigre.\n(Chance de ativar:15%, 100ms de recarga)"},
