[417149] = {name = "Eflorescência", additional_info = "[q]Sua Recomposição Rápida agora causa Eflorescência, curando [(38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60) * 16 / 100] pontos de vida de todos os integrantes do grupo em um raio de 15 m do local da Recomposição Rápida a cada 1 s por 15 sec."},
[417157] = {name = "Surto Estelar", additional_info = "Alcance de 30m\n{Instantâneo} {6 seg de recarga}\n[q]Dispara um surto de energias estelares que causa [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] a [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] de dano Arcano e aumenta em 80% o dano causado por 1 lançamento de Fogo Estelar por 15 sec.\n\n Surto Estelar ativa e se beneficia da maioria dos talentos e efeitos que ativam ou se beneficiam de Ira ou Fogo Estelar."},
