[417453] = {name = "Surra (Felino)", additional_info = "[q]Ganha várias habilidades demoníacas novas: Interromper, Investida Demoníaca, Uivo Demoníaco e Golpe Infernal.\n\n\nSufoca o inimigo com um surto de energia Sombria que causa 10 de dano, interrompe o lançamento de feitiços e impede o lançamento de qualquer feitiço da mesma escola por 5 sec.\n\n\nInveste contra um inimigo e o atordoa por 1 sec. Não pode ser usado em combate.\n\n\nForça todos os inimigos próximos a concentrarem os ataques em você por 6 sec.\n\n\nSalta pelo ar e aterrissa violentamente, atingindo todos os inimigos em um raio de 8 m da área selecionada, causando 100 de dano de Sombra e atordoando-os por 2 sec."},
