[424715] = {name = "Surto Estelar", additional_info = "[q]Concede a habilidade Surto Estelar:\n\n\nDispara um surto de energias estelares que causa [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] a [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] de dano Arcano e aumenta em 80% o dano causado por 1 lançamento de Fogo Estelar por 15 sec.\n\n Surto Estelar ativa e se beneficia da maioria dos talentos e efeitos que ativam ou se beneficiam de Ira ou Fogo Estelar."},
[424718] = {name = "Gravar Calça - Surto Estelar", additional_info = "3 seg de lançamento\nRequer Calças\n[q]Grava na calça a runa de Surto Estelar:\n\n\nDispara um surto de energias estelares que causa [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] a [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] de dano Arcano e aumenta em 80% o dano causado por 1 lançamento de Fogo Estelar por 15 sec.\n\n Surto Estelar ativa e se beneficia da maioria dos talentos e efeitos que ativam ou se beneficiam de Ira ou Fogo Estelar."},
