[424759] = {name = "Berserk", additional_info = "[q]Concede a habilidade Berserk:\n\n\nAo ser ativada, faz suas habilidades Destroçar (Urso) e Lacerar atingirem até 3 alvos, Lacerar não custar Raiva, e Destroçar (Urso) não ter recarga. Também reduz em 50% o custo de energia de todas as habilidades da sua Forma de Felino. Dura 15 sec. Requer Forma de Urso, Forma de Felino ou Forma de Urso Hediondo para se ativar.\n\n Remove Medo e concede imunidade a esse efeito por toda a duração."},
[424760] = {name = "Gravar Cinto - Berserk", additional_info = "3 seg de lançamento\nRequer Cinto\n[q]Grava no cinto a runa de Berserk:\n\n\nAo ser ativada, faz suas habilidades Destroçar (Urso) e Lacerar atingirem até 3 alvos, Lacerar não custar Raiva, e Destroçar (Urso) não ter recarga. Também reduz em 50% o custo de energia de todas as habilidades da sua Forma de Felino. Dura 15 sec. Requer Forma de Urso, Forma de Felino ou Forma de Urso Hediondo para se ativar.\n\n Remove Medo e concede imunidade a esse efeito por toda a duração."},
[424762] = {name = "Rei da Selva", additional_info = "[q]Concede a habilidade Rei da Selva:\n\n\nFúria do Tigre agora aumenta todo o dano Físico que você causa em 15%, em vez de um valor fixo, e concede instantaneamente 60 de Energia. Ela não entra mais na recarga global, mas agora tem a própria recarga de 30 s."},
