[425284] = {name = "Espírito do Redentor", additional_info = "{Instantâneo} {2 min de recarga}\n[q]Ativar torna você o Espírito da Redenção por 10 sec. Nesta forma, você pode lançar qualquer feitiço sem custo, mas não pode se mover, atacar, receber ataques ou ser alvo de feitiços ou efeitos. Requer o talento Redenção para ativação, e você não entra mais na forma de Espírito da Redenção ao morrer."},
