[425294] = {name = "Dispersão", additional_info = "{Instantâneo} {2 min de recarga}\n[q]Você se dispersa em pura energia Sombria, reduzindo em 90% todo o dano recebido. Você fica incapacitado de atacar ou lançar feitiços, mas regenera 6% dos pontos de mana a cada 1 s por 6 sec. Você pode lançar Dispersão enquanto estiver atordoado, amedrontado ou silenciado. Dispersão liberta você de lerdeza e de todos os efeitos que dificultam o movimento e faz com que fique imune a eles enquanto estiver disperso."},
[425302] = {name = "Renovação Potencializada", additional_info = "[q]Concede a habilidade Renovação Potencializada:\n\n\nSeu Renovar agora cura uma vez a mais imediatamente após a aplicação e concede 15% a mais do benefício dos seus efeitos de cura extra toda vez que cura.\n\n Além disso, seu Renovar agora pode ficar ativo em alvos afetados pelo Renovar de outro Sacerdote."},
[425303] = {name = "Esperança Renovada", additional_info = "[q]Concede a habilidade Esperança Renovada:\n\n\nSuas curas com Cura Célere, Cura Inferior, Cura, Cura Maior e Penitência têm 20% a mais de efeito quando são lançadas em alvos com Alma Enfraquecida."},
[425304] = {name = "Espírito do Redentor", additional_info = "[q]Concede a habilidade Espírito do Redentor:\n\n\nAtivar torna você o Espírito da Redenção por 10 sec. Nesta forma, você pode lançar qualquer feitiço sem custo, mas não pode se mover, atacar, receber ataques ou ser alvo de feitiços ou efeitos. Requer o talento Redenção para ativação, e você não entra mais na forma de Espírito da Redenção ao morrer."},
