[427065] = {name = "Violência Gratuita", additional_info = "[q]Seus acertos corpo a corpo críticos Enfurecem você (ativando habilidades que requerem estar Enfurecido), e aumentam em 10% o dano de Golpe Mortal, Sede de Sangue e Escudada por 12 sec."},
[427066] = {name = "Enfurecer", additional_info = "Instantâneo\n[q]Modifies Damage/Healing Done +11%:\nEscudada , Escudada , Escudada , Escudada , Golpe Mortal , Golpe Mortal , Golpe Mortal , Golpe Mortal , Sede de Sangue , Sede de Sangue , Sede de Sangue , Sede de Sangue"},
[427067] = {name = "Apetite por Sangue", additional_info = "[q]Concede a habilidade Apetite por Sangue:\n\n\nSempre que sua habilidade Dilacerar causar dano, sua habilidade Subjugar será ativada por 9 sec ou 1 ataque. Esse efeito não ocorrerá mais de uma vez a cada 6 s."},
[427068] = {name = "Vigilância", additional_info = "[q]Concede a habilidade Vigilância:\n\n\nConcentra seu olhar protetor em um integrante do grupo ou do raide, reduzindo em 3% o dano recebido por ele e transferindo para você 10% da ameaça causada por ele. Além disso, toda vez que ele for atingido em combate, a recarga da sua habilidade Provocar é concluída. Dura 30 min. Este efeito só funciona em um alvo de cada vez."},
[427069] = {name = "Proficiência em Escudo", additional_info = "[q]Concede a habilidade Proficiência em Escudo:\n\n\nAumenta em 10% todo o dano Físico causado enquanto tiver um escudo equipado, e reduz em 50% a duração de todos os efeitos de Desarmar usados contra você. Não acumula com outros efeitos de redução de duração de Desarmar."},
[427070] = {name = "Alvoroço", additional_info = "[q]Concede a habilidade Alvoroço:\n\n\nEntra em alvoroço, aumentando em 10% seu poder de ataque por 30 sec. Esta habilidade só pode ser usada enquanto você está Enfurecido."},
[427073] = {name = "Espada e Escudo", additional_info = "[q]Concede a habilidade Espada e Escudo:\n\n\nQuando suas habilidades Devastar ou Revanche causam dano, você tem 30% de chance de completar a recarga da habilidade Escudada e reduzir em 100% o custo dela por 5 sec."},
[427074] = {name = "Violência Gratuita", additional_info = "[q]Concede a habilidade Violência Gratuita:\n\n\nSeus acertos corpo a corpo críticos Enfurecem você (ativando habilidades que requerem estar Enfurecido), e aumentam em 10% o dano de Golpe Mortal, Sede de Sangue e Escudada por 12 sec."},
