[429348] = {name = "[q4]Peitoral de Prata Cambiante", additional_info = "45 seg de lançamento\nFerramentas: Martelo de Ferreiro\nReagentes:\nPeitoral de Prata Rutilante , Estilhaço do Caos\n[q4]Peitoral de Prata Cambiante\nVincula-se ao ser recolhido\nÚnico-equipado: [Void-Touched] (1)Torso Malha\n238 Armadura\n+12 Força\n+5 Vigor\nDurabilidade 145 / 145\n25\nRequerFerraria\n(100)\n[q2]Equipar: Este item é imbuído com o poder bruto do Caos. Quando o portador é atacado, o item tem chance elevada de causar uma maldição terrível, fazendo o atacante receber dano adicional de todas as fontes por 15 s. (Chance de ativar:25%)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques."},
