[432296] = {name = "Ir ao Ponto", additional_info = "[q]Concede a habilidade Ir ao Ponto:\n\n\nSuas habilidades Eviscerar e Envenenar renovam a duração de Retalhar ou Dança de Lâminas para o máximo de 5 pontos de combo. Se ambas estiverem ativas, somente a com duração restante mais curta será renovada."},
