[432298] = {name = "Chacina", additional_info = "[q]Concede a habilidade Chacina:\n\n\nSuas habilidades causam 8% a mais de dano aos alvos afetados por um dos seus efeitos de Sangramento. Sua Ruptura também concede a você uma cura equivalente a 40% do dano que ela causa."},
