[435951] = {name = "[q4]Capuz Gneurocondutor do Canalizador", additional_info = "45 seg de lançamento\nReagentes:\nGniodina com Isolamento Térmico , Pelego Grosso Curado (5), Couro Levemente Luminoso (5), Arcanofilamento Hipercondutor\n[q4]Capuz Gneurocondutor do Canalizador\nVincula-se ao ser recolhido\nCabeça Couro\n118 Armadura\n+11 Vigor\n+12 Intelecto\n+11 Espírito\nDurabilidade 70 / 70\n40\nRequerCouraria\n(225)\n[q2]Equipar: Aumenta em até 21 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Uso: Ganha meditação gneuromante, permitindo que 100% da sua regeneração de mana continue durante o lançamento de feitiços e aumentando em até 50 o dano causado e a cura realizada com feitiços por 20 sec. (10 Min Recarga)"},
[435952] = {name = "Molde: Capuz Gneurocondutor do Canalizador", additional_info = "Alcance de 100m\n3 seg de lançamento\n[q]Ensina a fazer Capuz Gneurocondutor do Canalizador."},
[435953] = {name = "[q4]Capuz de Escamas com Resistência à Radiação", additional_info = "45 seg de lançamento\nReagentes:\nPlacas de Veraprata de Baixa Radioatividade , Pelego Grosso Curado (5), Couro Levemente Luminoso (5), Gniodina com Isolamento Térmico\n[q4]Capuz de Escamas com Resistência à Radiação\nVincula-se ao ser recolhido\nCabeça Malha\n[q2]342 Armadura\n+10 Vigor\n+10 Intelecto\nDurabilidade 85 / 85\n40\nRequerCouraria\n(225)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: +32 de Poder de Ataque.\n[q2]Uso: Aciona os protocolos de mitigação de radiação do capacete, fazendo você remover imediatamente todos os efeitos de veneno ativos e ganhar imunidade a dano de Natureza por 3 sec. (10 Min Recarga)"},
[435954] = {name = "Molde: Capuz de Escamas com Resistência à Radiação", additional_info = "Alcance de 100m\n3 seg de lançamento\n[q]Ensina a fazer Capuz de Escamas com Resistência à Radiação."},
