[435958] = {name = "[q4]Engrenomuralha de Veraprata Rodopiante", additional_info = "45 seg de lançamento\nFerramentas: Martelo de Ferreiro\nReagentes:\nPlacas de Veraprata de Baixa Radioatividade (3), Engrenagens de Veraprata Polidas (5), Couro Levemente Luminoso (2), Carcaça de Mithril (2), Giroscronatom (2), Barra de Mithril (15)\n[q4]Engrenomuralha de Veraprata Rodopiante\nVincula-se ao ser recolhido\nMão Secundária Escudo\n1760 Armadura\nBloqueio de 29\n+9 Força\n+10 Vigor\nDurabilidade 120 / 120\n40\nRequerEngenharia\n(225)\n[q2]Equipar: Aumenta em 1% a chance de bloquear ataques com o escudo.\n[q2]Equipar: Em um bloqueio bem-sucedido, as engrenagens afiadíssimas deste escudo causam 5 to 10 de dano Físico ao atacante e 2 to 10 de dano Físico ao portador.\n[q]\"As bordas giratórias deste escudo são surpreendentemente afiadas. Parece perigoso, tanto para o atacante quanto para o portador.\""},
[435959] = {name = "Diagrama: Engrenomuralha de Veraprata Rodopiante", additional_info = "Alcance de 100m\n3 seg de lançamento\n[q]Ensina a fazer Engrenhomuralha de Veraprata Rodopiante."},
[435960] = {name = "[q4]Faixa de Ouro Hipercondutora", additional_info = "45 seg de lançamento\nFerramentas: Chave de Arco Voltaico\nReagentes:\nEngrenagens de Veraprata Polidas (3), Arcanofilamento Hipercondutor (3), Couro Levemente Luminoso , Barra de Ouro (10)\n[q4]Faixa de Ouro Hipercondutora\nVincula-se ao ser recolhido\nCintura Tecido\n40 Armadura\n+9 Vigor\nDurabilidade 35 / 35\n40\nRequerEngenharia\n(225)\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Uso: Tira uma moeda hipercondutora do seu cinto para um cara ou coroa. Cara: ganha 3% a mais de chance de acerto crítico com todos os ataques e feitiços por 30 sec. Coroa: ganha 10% de velocidade de movimento por 30 sec. (15 Min Recarga)\n[q]\"O cinto emite um leve tilintar quando você se move.\""},
