[436516] = {name = "Preservação Cronostática", additional_info = "24% de base mana Alcance ilimitado\n2 seg de lançamento\n[q]$?a443369[Cura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 200 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 300 / 100] pontos de vida de um alvo aliado.]\n [Funde magia Arcana, de Fogo e de Gelo para congelar energia cronomântica para uso posterior. Você pode manter essa energia por até 20 sec, antes de ela entrar em combustão e expirar. Ao ser lançada, cura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 200 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 300 / 100] pontos de vida de um alvo aliado.\n\n Este feitiço é considerado de Fogo, Gelo e Arcano em interações com outros feitiços, talentos e efeitos.]"},
