[459706] = {name = "A graça de Eluna", additional_info = "Instantâneo\n[q]Concede a habilidade Graça de Eluna:\n\n\nReduz em 95 o dano recebido de ataques de longo alcance e aumenta em 10% a chance de esquiva por 15 sec."},
[459709] = {name = "Guarda Sombrio", additional_info = "Instantâneo\n[q]Concede a habilidade Guarda Sombrio:\n\n\nO lançador fica envolto por sombras. Quando um feitiço, um ataque corpo a corpo ou um ataque de longo alcance acertar o lançador, o agressor receberá 116 de dano de Sombra. Agressores só recebem esse dano uma vez a cada alguns segundos. Este dano não gera ameaça. 3 cargas. Dura 10 min."},
[459710] = {name = "Bagata da Fraqueza", additional_info = "Instantâneo\n[q]Concede a habilidade Bagata da Fraqueza:\n\n\nEnfraquece o inimigo alvo, reduzindo em 20 o dano causado e reduzindo em 20% a eficácia de qualquer efeito de cura. Dura 2 min."},
[459713] = {name = "Peste Devoradora", additional_info = "Instantâneo\n[q]Concede a habilidade Peste Devoradora:\n\n\nCausa uma doença no alvo que causa 904 de dano de Sombra ao longo de 24 sec. O dano causado pela Peste Devoradora cura o lançador."},
